31	An example standard index page	<h3>Our Mission</h3><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.<br/></p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p><h3>Our Goals</h3><ol><li>to implement and extend data standards for paleoanthropology;</li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;</li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.</li></ol><p>Through these goals the project seeks, more broadly, to develop tools that support digital infrastructure, data exchange and interoperability in the social and behavioral sciences.</p><h3>The Name</h3><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as<a href="http://dublincore.org/">Dublin Core</a>,<a href="http://rs.tdwg.org/dwc/terms/">Darwin Core</a>and<a href="http://www.tdwg.org/standards/115/download/ABCD_v206.html">Access to Biological Collections Data</a>(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p><h3>Funding and Support</h3><p>PaleoCore is funded by a grant from the US National Science Foundation (<a href="http://www.nsf.gov/awardsearch/showAward?AWD_ID=1244735">NSF 1244735</a>). PaleoCore receives additional support for server and network infrastructure from the<a href="https://www.tacc.utexas.edu/">Texas Advanced Computing Center</a>. As an open-source software project PaleoCore receives support from<a href="https://www.jetbrains.com/">Jet Brains software</a>, which provides free licensing for PyCharm IDE software, and from<a href="https://www.dbvis.com/">DB Vis software</a>, which provides free licensing for DB Visualizer database management software.</p><h3>PaleoCore is Built on Open-Source Technology</h3><p>The PaleoCore website and associated mobile data collection tools are built on free open-source software (FOSS). The database is implemented with<a href="http://www.postgresql.org/">PostgreSQL</a>using<a href="http://postgis.net/">PostGIS</a>to manage spatial data. The website is developed in<a href="https://www.python.org/">Python</a>using the<a href="https://www.djangoproject.com/">Django</a>web application framework and takes advantage of<a href="https://docs.djangoproject.com/en/1.8/ref/contrib/gis/">geoDjango</a>to present spatial data in the web interface. The code base for the project is freely available online through<a href="https://github.com/paleocore">GitHub</a>. The mobile data collection workflows use proprietary software such as ESRI ArcPad and GISPro but FOSS implementations for Android are in development.</p>	\N	pages/standard_index_page.html
