35	<p>A Pliocene Site in Ethiopia</p>	[{"type": "paragraph", "value": "<p>The Dikika Research Project (DRP) studies Pliocene hominins and paleoenvironments in the Afar Region of northeastern Ethiopia. Dikika is best known for the 3.3 Ma juvenile\\u00a0<i>Australopithecus afarensis</i>\\u00a0fossil known as &quot;Selam&quot;. Selam is the most complete fossil skeleton of this species and one of just a handful of juvenile hominin fossil skeletons known.</p><p>The project is lead by Dr. Zeresenay Alemseged of the University of Chicago. Core DRP team members include: Zeresenay Alemseged, Andrew Barr, Ren\\u00e9 Bobe, Denis Geraads, Shannon McPherron, Denn\\u00e9 Reed, and Jonathan Wynn.</p><p>The data in the Dikika Research Project are currently restricted to project members.</p>", "id": "029ce7d4-63ac-4a87-ba3d-b29690e0b143"}]	2020-03-30	0101000020E6100000B01C5A643B4F4440AE47E17A142E2640	f	25	drp
40	<p>A Paleogene site in central North America.</p>	[{"type": "paragraph", "value": "<p>The Great Divide Basin (GDB) Project collects and studies mammalian fossils across the Paleocene-Eocene boundary (ca. 55 mya) in southern Wyoming. In addition, we apply tools and techniques from the geographic information sciences (e.g., satellite imagery, drones, photogrammetry, and LiDAR) to generate predictive models for the location of fossil localities.</p><p>The project is led by Dr. Robert Anemone of the University of North Carolina at Greensboro. Core team members include remote sensing specialist Jay Emerson, biological anthropologist Brett Nachman, geologist Ron Watkins and vertebrate paleontologist Michele Stocker. Photo credit: David Wilson</p><p>The data in the Great Divide Basin are currently restricted to project members.</p>", "id": "712208fc-2c6e-4183-a533-ab1bdbab20e7"}]	2020-03-30	0101000020E6100000508D976E12F35AC01B2FDD2406014540	f	35	gdb
36	<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>	[{"type": "paragraph", "value": "<p><br/></p>", "id": "7ec7560a-b855-49eb-aaf5-b68f971fd191"}]	2020-03-30	0101000020E6100000E0FDFF7F774E4440ABD9CBDC89482640	f	36	hrp
37	<p>omo-mursi</p>	[{"type": "paragraph", "value": "<p>omo-mursi</p>", "id": "5792cfb0-2452-4fe8-96e4-01544a253390"}]	2020-03-30	0101000020E6100000000300FB97004240D262B92A16CE1340	f	39	omo_mursi
38	<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>	[{"type": "paragraph", "value": "<p>The Mille-Logya Research Project (MLP) is a paleoanthropological research effort located in northeastern Ethiopia, just a few kilometers north of Hadar and Dikika. The project was initiated in 2014. The project is lead by Dr. Zeresenay Alemseged of the University of Chicago. The data in the Mille-Logya Project are currently restricted to project members.<br/></p>", "id": "d68ec6af-538b-4cdf-84f2-4406081d722b"}]	2020-03-30	0101000020E610000041E17A14AE674440D122DBF97E2A2740	f	38	mlp
34	<p>Laetoli, a Plio-Pleistocene site in northern Tanzania.<br/></p>	[{"type": "paragraph", "value": "<p>The EPPE Laeotoli specimen database contains 13713 records of plant and animal fossils (ca. 28248 specimens) collected by EPPE field teams working at Laetoli, Tanzania. This database is a digital version of the original hard-copy specimen catalog and documents the discovery, stratigraphic provenience and taxonomic diversity of Pliocene and Pleistocene fauna and flora in\\u00a0 northern Tanzania in the time range between 3.7 Ma to 200 ka. The collections include important lectotypes for\\u00a0<i>Australopithecus afarensis</i>, the first record of\\u00a0<i>Paranthropus aethiopicus</i>\\u00a0outside Kenya and early records of our own species\\u00a0<i>Homo sapiens</i>. The taxonomic identifications appearing in this dataset are the original field identifications and are provisional. Any taxonomic analysis employing this dataset should refer to updated identifications published by specialists in the appropriate taxonomic domain (e.g. Harrison 2011).\\u00a0</p>", "id": "49fe291c-91d2-44ad-b5ca-27f1ae72b726"}]	2020-03-30	0101000020E610000030333333339341403333333333330BC0	t	21	eppe
42	<p>A Pleistocene archaeological site in France.</p>	[{"type": "paragraph", "value": "<p>Combe-Capelle Bas is one of a several sites at Combe-Capelle. It is an open-air site located at the base of a terraced slope of the Couze valley in southwest France. Until recently, the site was best known from the excavations of Ami who worked there until 1931 and discovered a series of Middle Paleolithic assemblages. In 1987, Dibble and Lenoir started new excavations at the site. In four seasons they re-sampled deposits along Ami&#39;s excavation trench and tested briefly another of the Combe-Capelle sites, Abri Peyrony. The new excavations were conducted following methods that Dibble and colleagues innovated including the use of total stations to systematically piece provenience excavated artifacts and buckets of sediments. The site monograph was published in 1995. The database was published in 1996 as a CD and subsequently appeared on-line at www.oldstoneage.com. Here a newly cleaned and reformatted version of this database is presented along with all available artifact images. The Combe Capelle project database is managed by Shannon McPherron.<br/></p>", "id": "7e2fa5e4-8763-42e2-8e14-40680c5c9980"}]	2020-03-30	0101000020E610000000F000C06627EB3F112B3FEA72604640	f	33	cc
41	<p>A Pleistocene archaeological site in France.</p>	[{"type": "paragraph", "value": "<p>Fontechevade is a cave site in the Charente region of southern France. It was best known from the excavations of G. Henri-Martin who excavated there from 1937 to 1954 and fully published the results. Based on this work, the site became the type site for the Tayacian stone tool industry. Tayacian is characterized by a rather non-descript technology and a high percentage of notched tools. The site was also known for two hominin fossil fragments. The site was re-excavated from 1994 to 1999 by a team from the University of Pennsylvania (Dibble, Chase and McPherron) and the University of Perpignan (Deb\\\\\\\\u00e9nath), and a monograph was published in 2009. The new excavations and a re-analysis of the Henri-Martin collection demonstrated that the Tayacian was a result of site formation processes, and that the majority of deposits in the cave contain very little evidence of hominin behaviors there. The excavations were conducted using the same methodologies that Dibble and colleagues developed at Combe-Capelle Bas. The full database can be found at www.oldstoneage.com. Here a further cleaned version of this database is provided along with artifact images.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;The Fontechevade data are currently restricted to project members.<br/></p>", "id": "b0e3351f-e845-4559-b261-6842d8722460"}]	2020-03-30	0101000020E610000000980080FDBDDE3F4D62B9F665D74640	f	34	fc
39	<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>	[{"type": "paragraph", "value": "<p>The Ledi-Geraru Research Project was started in 2002. Research focuses on answering questions regarding the disappearance of\\u00a0<i>Australopithecus afarensis</i>\\u00a0and the appearance of the genus\\u00a0<i>Homo</i>\\u00a0in the time period from 2.95 Ma- 2.4 Ma. These questions are related to habitat and behavioral differences between the two species. Fossiliferous sediments of that age are fairly rare in the Lower Awash Valley, but are present in the Ledi-Geraru, as well as some deposits that are younger still.</p><p>Co-leaders of the project are Kaye Reed, Ramon Arrowsmith, Christopher Campisano, and Brian Villmoare. Other participants include Lars Werdelin, Vera Aldeais, Marion Bamford, David Braun, Alan Deino, Erin DiMaggio, Guillaume Dupont-Nivet, David Feary, William Kimbel, Amy Rector, Joshua Robinson, William Archer, Blade Engda, Domnique Garello, Jacob Harris, Ignacio Lazagabaster, Ellis Locke, David Patterson, John Rowan, Chalachew Seyoum, Niguss Tsehay, Eric Scott, and Irene Smail.\\u00a0The data in the Ledi-Geraru Research Project are currently restricted to project members.</p>", "id": "467c2948-59d5-4b43-9c4d-f0e86bf33c4a"}]	2020-03-30	0101000020E610000060635E471C6E44409626A5A0DBB32640	f	37	lgrp
43	<p>A Plio-Pleistocene site in northern Kenya</p>	[{"type": "paragraph", "value": "<p>The West Turkana Archaeological Project (WTAP)\\u00a0is a multinational interdisciplinary research collaboration that seeks to\\u00a0uncover artifactual and\\u00a0fossil traces of Plio-Pleistocene hominin behavioral evolution in\\u00a0the sedimentary exposures of the Nachukui Formation west of\\u00a0Lake Turkana in northern Kenya. The WTAP is now best known for the discovery of the oldest stone tools at Lomekwi 3, dated to 3.3 Ma, and the oldest Acheulean handaxes at Kokiselei 4, dated to 1.76 Ma.</p><p><br/></p><p>The project is directed by Dr.\\u00a0Sonia Harmand (Turkana Basin\\u00a0Institute [TBI] and\\u00a0Dept. of\\u00a0Anthropology at Stony Brook University, and the CNRS) and Dr. Jason Lewis (TBI &amp; Anthro at Stony Brook). Core WTAP team members additionally include: Helene Roche, Craig Feibel, Sandrine Prat, Xavier Bo\\u00ebs, Nicholas Taylor, Jean-Philip Brugal.</p>", "id": "df6c8aff-693c-4e56-814d-7fa3fe6de5c3"}]	2020-06-11	0101000020E61000006666666666E641400000000000001040	f	40	\N
62	<p>A survey of Pleistocene sites in Asia.</p>	[{"type": "paragraph", "value": "In antiquity and the early Middle Ages, a network of trade routes known as the Silk Road connected east Asia and the Middle East. The Silk Road was not just an economic link, but also the avenue for cultural and even genetic exchanges between these regions. Recent genetic discoveries have hinted that such connections might have begun much earlier, during the Pleistocene. The Pleistocene period is of fundamental importance for human history. It is then that our ancestors evolved and colonised the entire Old World, surviving a suite of major extinction events \\u2013 and they did so against a dramatic backdrop of ice ages and warmer interglacial phases which substantially altered their habitats. Conquering the extreme environments of arid central Asia to eventually settle the entire Asian mainland and beyond is one of the most impressive feats in this story. Unfortunately, there are too few known Pleistocene archaeological sites in central Asia to allow us to piece together when and how this happened.<br/><br/>PALAEOSILKROAD will resolve this deficit by surveying central Asian mountain foothills as both corridors for human and animal movements and archives of past climate change. The project will discover new sites in the Tian Shan, Dzungar, and southern Altai foothills (Kazakhstan) and use them to examine if and how 1) humans were able to survive in the foothills throughout the last glacial cycle (ca.\\u00a0<a href=\\"tel://110-11 500\\">110-11 500</a>\\u00a0years ago), and 2) periodic advances of mountain glaciers motivated dispersals, population segmentation, and behavioural adaptations. To address these questions, PALAEOSILKROAD will take an ambitious approach rooted in archaeology and contextualised by palaeoenvironmental reconstruction. The results of this project will change the way we understand human dispersals on a global scale and the resilience of early humans in the face of environmental challenges, providing a major missing link to explain how Homo sapiens became the only surviving species of our genus.<br/><br/>The Principal Investigator is Prof. Radu Iovita (New York University, University of T\\u00fcbingen)<br/><p><a href=\\"https://www.palaeosilkroad.eu/\\">https://www.palaeosilkroad.eu/</a></p>", "id": "18b37bc4-a499-4186-ab50-6ea3a51d1f2a"}]	2020-07-10	0101000020E61000000AD6389B8E3A5340E46A64575AA04540	f	44	psr
