81	f	2020-03-26 12:42:30.283684-07	{"pk": 31, "path": "000100010009", "depth": 3, "numchild": 0, "title": "About Index", "draft_title": "About Index", "slug": "about-index", "content_type": 32, "live": true, "has_unpublished_changes": false, "url_path": "/home/about-index/", "owner": 4, "seo_title": "About", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-09T05:01:16.053Z", "last_published_at": "2020-03-09T05:01:44.854Z", "latest_revision_created_at": "2020-03-09T05:01:44.661Z", "live_revision": 69, "subtitle": "An example standard index page", "intro": "<h3>Our Mission</h3><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.<br/></p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p><h3>Our Goals</h3><ol><li>to implement and extend data standards for paleoanthropology;</li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;\\u00a0</li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.</li></ol><p>Through these goals the project seeks, more broadly, to develop tools that support digital infrastructure, data exchange and interoperability in the social and behavioral sciences.\\u00a0</p><h3>The Name</h3><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as\\u00a0<a href=\\"http://dublincore.org/\\">Dublin Core</a>,\\u00a0<a href=\\"http://rs.tdwg.org/dwc/terms/\\">Darwin Core</a>\\u00a0and\\u00a0<a href=\\"http://www.tdwg.org/standards/115/download/ABCD_v206.html\\">Access to Biological Collections Data</a>\\u00a0(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p><h3>Funding and Support</h3><p>PaleoCore is funded by a grant from the US National Science Foundation (<a href=\\"http://www.nsf.gov/awardsearch/showAward?AWD_ID=1244735\\">NSF 1244735</a>). PaleoCore receives additional support for server and network infrastructure from the\\u00a0<a href=\\"https://www.tacc.utexas.edu/\\">Texas Advanced Computing Center</a>. As an open-source software project PaleoCore receives support from\\u00a0<a href=\\"https://www.jetbrains.com/\\">Jet Brains software</a>, which provides free licensing for PyCharm IDE software, and from\\u00a0<a href=\\"https://www.dbvis.com/\\">DB Vis software</a>, which provides free licensing for DB Visualizer database management software.</p><h3>PaleoCore is Built on Open-Source Technology\\u00a0</h3><p>The PaleoCore website and associated mobile data collection tools are built on free open-source software (FOSS). The database is implemented with\\u00a0<a href=\\"http://www.postgresql.org/\\">PostgreSQL</a>\\u00a0using\\u00a0<a href=\\"http://postgis.net/\\">PostGIS</a>\\u00a0to manage spatial data. The website is developed in\\u00a0<a href=\\"https://www.python.org/\\">Python</a>\\u00a0using the\\u00a0<a href=\\"https://www.djangoproject.com/\\">Django</a>\\u00a0web application framework and takes advantage of\\u00a0<a href=\\"https://docs.djangoproject.com/en/1.8/ref/contrib/gis/\\">geoDjango</a>\\u00a0to present spatial data in the web interface. The code base for the project is freely available online through\\u00a0<a href=\\"https://github.com/paleocore\\">GitHub</a>. The mobile data collection workflows use proprietary software such as ESRI ArcPad and GISPro but FOSS implementations for Android are in development.</p>", "template_string": "pages/standard_index_page.html", "feed_image": null, "related_links": []}	\N	31	4
