135	f	2020-04-09 16:59:30.225949-07	{"pk": 42, "path": "00010001000B0009", "depth": 4, "numchild": 0, "title": "Combe-Capelle Bas (cc)", "draft_title": "Combe-Capelle Bas (cc)", "slug": "cc", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/cc/", "owner": 4, "seo_title": "cc", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:59:35.962Z", "last_published_at": "2020-04-09T23:25:14.855Z", "latest_revision_created_at": "2020-04-09T23:25:14.676Z", "live_revision": 119, "intro": "<p>A Pleistocene archaeological site in France.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>Combe-Capelle Bas is one of a several sites at Combe-Capelle. It is an open-air site located at the base of a terraced slope of the Couze valley in southwest France. Until recently, the site was best known from the excavations of Ami who worked there until 1931 and discovered a series of Middle Paleolithic assemblages. In 1987, Dibble and Lenoir started new excavations at the site. In four seasons they re-sampled deposits along Ami\\\\\\\\\\\\\\\\u2019s excavation trench and tested briefly another of the Combe-Capelle sites, Abri Peyrony. The new excavations were conducted following methods that Dibble and colleagues innovated including the use of total stations to systematically piece provenience excavated artifacts and buckets of sediments. The site monograph was published in 1995. The database was published in 1996 as a CD and subsequently appeared on-line at www.oldstoneage.com. Here a newly cleaned and reformatted version of this database is presented along with all available artifact images.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;The Combe Capelle project database is managed by Shannon McPherron&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;The data in the Combe Capelle are currently restricted to project members.<br/></p>\\", \\"id\\": \\"7e2fa5e4-8763-42e2-8e14-40680c5c9980\\"}]", "date": "2020-03-30", "feed_image": 29, "location": "SRID=4326;POINT (0.8485597372123266 44.753506928295)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	42	4
