156	f	2020-06-06 19:14:40.098119-07	{"pk": 36, "path": "00010001000B0003", "depth": 4, "numchild": 0, "title": "Hadar Research Project (hrp)", "draft_title": "Hadar Research Project (hrp)", "slug": "hrp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/hrp/", "owner": 4, "seo_title": "hrp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:49:45.725Z", "last_published_at": "2020-04-09T23:46:37.206Z", "latest_revision_created_at": "2020-04-09T23:46:36.975Z", "live_revision": 131, "intro": "<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>blah</p>\\", \\"id\\": \\"7ec7560a-b855-49eb-aaf5-b68f971fd191\\"}]", "date": "2020-03-30", "feed_image": 24, "location": "SRID=4326;POINT (40.61302185058207 11.141676807293)", "is_public": false, "app_label": "hrp", "carousel_items": [], "related_links": [], "tagged_items": [{"pk": null, "tag": 2, "content_object": 36}, {"pk": null, "tag": 13, "content_object": 36}]}	\N	36	4
68	f	2020-03-08 22:01:15.923234-07	{"pk": 31, "path": "000100010009", "depth": 3, "numchild": 0, "title": "About Index", "draft_title": "About Index", "slug": "about-index", "content_type": 32, "live": true, "has_unpublished_changes": false, "url_path": "/home/about-index/", "owner": 4, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "subtitle": "An example standard index page", "intro": "<h3>Our Mission</h3><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.<br/></p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p><h3>Our Goals</h3><ol><li>to implement and extend data standards for paleoanthropology;</li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;\\u00a0</li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.</li></ol><p>Through these goals the project seeks, more broadly, to develop tools that support digital infrastructure, data exchange and interoperability in the social and behavioral sciences.\\u00a0</p><h3>The Name</h3><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as\\u00a0<a href=\\"http://dublincore.org/\\">Dublin Core</a>,\\u00a0<a href=\\"http://rs.tdwg.org/dwc/terms/\\">Darwin Core</a>\\u00a0and\\u00a0<a href=\\"http://www.tdwg.org/standards/115/download/ABCD_v206.html\\">Access to Biological Collections Data</a>\\u00a0(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p><h3>Funding and Support</h3><p>PaleoCore is funded by a grant from the US National Science Foundation (<a href=\\"http://www.nsf.gov/awardsearch/showAward?AWD_ID=1244735\\">NSF 1244735</a>). PaleoCore receives additional support for server and network infrastructure from the\\u00a0<a href=\\"https://www.tacc.utexas.edu/\\">Texas Advanced Computing Center</a>. As an open-source software project PaleoCore receives support from\\u00a0<a href=\\"https://www.jetbrains.com/\\">Jet Brains software</a>, which provides free licensing for PyCharm IDE software, and from\\u00a0<a href=\\"https://www.dbvis.com/\\">DB Vis software</a>, which provides free licensing for DB Visualizer database management software.</p><h3>PaleoCore is Built on Open-Source Technology\\u00a0</h3><p>The PaleoCore website and associated mobile data collection tools are built on free open-source software (FOSS). The database is implemented with\\u00a0<a href=\\"http://www.postgresql.org/\\">PostgreSQL</a>\\u00a0using\\u00a0<a href=\\"http://postgis.net/\\">PostGIS</a>\\u00a0to manage spatial data. The website is developed in\\u00a0<a href=\\"https://www.python.org/\\">Python</a>\\u00a0using the\\u00a0<a href=\\"https://www.djangoproject.com/\\">Django</a>\\u00a0web application framework and takes advantage of\\u00a0<a href=\\"https://docs.djangoproject.com/en/1.8/ref/contrib/gis/\\">geoDjango</a>\\u00a0to present spatial data in the web interface. The code base for the project is freely available online through\\u00a0<a href=\\"https://github.com/paleocore\\">GitHub</a>. The mobile data collection workflows use proprietary software such as ESRI ArcPad and GISPro but FOSS implementations for Android are in development.</p>", "template_string": "pages/standard_index_page.html", "feed_image": null, "related_links": []}	\N	31	4
122	f	2020-04-09 16:26:37.190265-07	{"pk": 39, "path": "00010001000B0006", "depth": 4, "numchild": 0, "title": "Ledi-Geraru Research Project (lgrp)", "draft_title": "Ledi-Geraru Research Project (lgrp)", "slug": "lgrp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/lgrp/", "owner": 4, "seo_title": "lgrp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:53:49.201Z", "last_published_at": "2020-03-31T05:54:43.858Z", "latest_revision_created_at": "2020-03-31T05:54:43.510Z", "live_revision": 109, "intro": "<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Ledi-Geraru Research Project was started in 2002. Research focuses on answering questions regarding the disappearance of &lt;i&gt;Australopithecus afarensis&lt;/i&gt; and the appearance of the genus &lt;i&gt;Homo&lt;/i&gt; in the time period from 2.95 Ma- 2.4 Ma. These questions are related to habitat and behavioral differences between the two species. Fossiliferous sediments of that age are fairly rare in the Lower Awash Valley, but are present in the Ledi-Geraru, as well as some deposits that are younger still.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;Co-leaders of the project are Kaye Reed, Ramon Arrowsmith, Christopher Campisano, and Brian Villmoare. Other participants include Lars Werdelin, Vera Aldeais, Marion Bamford, David Braun, Alan Deino, Erin DiMaggio, Guillaume Dupont-Nivet, David Feary, William Kimbel, Amy Rector, Joshua Robinson, William Archer, Blade Engda, Domnique Garello, Jacob Harris, Ignacio Lazagabaster, Ellis Locke, David Patterson, John Rowan, Chalachew Seyoum, Niguss Tsehay, Eric Scott, and Irene Smail.\\\\u00a0The data in the Ledi-Geraru Research Project are currently restricted to project members.</p>\\", \\"id\\": \\"467c2948-59d5-4b43-9c4d-f0e86bf33c4a\\"}]", "date": "2020-03-30", "feed_image": null, "location": "SRID=4326;POINT (40.86023799999998 11.351285)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	39	4
69	f	2020-03-08 22:01:44.661884-07	{"pk": 31, "path": "000100010009", "depth": 3, "numchild": 0, "title": "About Index", "draft_title": "About Index", "slug": "about-index", "content_type": 32, "live": true, "has_unpublished_changes": false, "url_path": "/home/about-index/", "owner": 4, "seo_title": "About", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-09T05:01:16.053Z", "last_published_at": "2020-03-09T05:01:16.053Z", "latest_revision_created_at": "2020-03-09T05:01:15.923Z", "live_revision": 68, "subtitle": "An example standard index page", "intro": "<h3>Our Mission</h3><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.<br/></p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p><h3>Our Goals</h3><ol><li>to implement and extend data standards for paleoanthropology;</li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;\\u00a0</li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.</li></ol><p>Through these goals the project seeks, more broadly, to develop tools that support digital infrastructure, data exchange and interoperability in the social and behavioral sciences.\\u00a0</p><h3>The Name</h3><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as\\u00a0<a href=\\"http://dublincore.org/\\">Dublin Core</a>,\\u00a0<a href=\\"http://rs.tdwg.org/dwc/terms/\\">Darwin Core</a>\\u00a0and\\u00a0<a href=\\"http://www.tdwg.org/standards/115/download/ABCD_v206.html\\">Access to Biological Collections Data</a>\\u00a0(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p><h3>Funding and Support</h3><p>PaleoCore is funded by a grant from the US National Science Foundation (<a href=\\"http://www.nsf.gov/awardsearch/showAward?AWD_ID=1244735\\">NSF 1244735</a>). PaleoCore receives additional support for server and network infrastructure from the\\u00a0<a href=\\"https://www.tacc.utexas.edu/\\">Texas Advanced Computing Center</a>. As an open-source software project PaleoCore receives support from\\u00a0<a href=\\"https://www.jetbrains.com/\\">Jet Brains software</a>, which provides free licensing for PyCharm IDE software, and from\\u00a0<a href=\\"https://www.dbvis.com/\\">DB Vis software</a>, which provides free licensing for DB Visualizer database management software.</p><h3>PaleoCore is Built on Open-Source Technology\\u00a0</h3><p>The PaleoCore website and associated mobile data collection tools are built on free open-source software (FOSS). The database is implemented with\\u00a0<a href=\\"http://www.postgresql.org/\\">PostgreSQL</a>\\u00a0using\\u00a0<a href=\\"http://postgis.net/\\">PostGIS</a>\\u00a0to manage spatial data. The website is developed in\\u00a0<a href=\\"https://www.python.org/\\">Python</a>\\u00a0using the\\u00a0<a href=\\"https://www.djangoproject.com/\\">Django</a>\\u00a0web application framework and takes advantage of\\u00a0<a href=\\"https://docs.djangoproject.com/en/1.8/ref/contrib/gis/\\">geoDjango</a>\\u00a0to present spatial data in the web interface. The code base for the project is freely available online through\\u00a0<a href=\\"https://github.com/paleocore\\">GitHub</a>. The mobile data collection workflows use proprietary software such as ESRI ArcPad and GISPro but FOSS implementations for Android are in development.</p>", "template_string": "pages/standard_index_page.html", "feed_image": null, "related_links": []}	\N	31	4
163	f	2020-06-09 11:58:54.473169-07	{"pk": 42, "path": "00010001000B0009", "depth": 4, "numchild": 0, "title": "Combe-Capelle Bas", "draft_title": "Combe-Capelle Bas", "slug": "cc", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/cc/", "owner": 4, "seo_title": "cc", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:59:35.962Z", "last_published_at": "2020-06-08T23:28:59.410Z", "latest_revision_created_at": "2020-06-08T23:28:59.146Z", "live_revision": 159, "intro": "<p>A Pleistocene archaeological site in France.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>Combe-Capelle Bas is one of a several sites at Combe-Capelle. It is an open-air site located at the base of a terraced slope of the Couze valley in southwest France. Until recently, the site was best known from the excavations of Ami who worked there until 1931 and discovered a series of Middle Paleolithic assemblages. In 1987, Dibble and Lenoir started new excavations at the site. In four seasons they re-sampled deposits along Ami&#39;s excavation trench and tested briefly another of the Combe-Capelle sites, Abri Peyrony. The new excavations were conducted following methods that Dibble and colleagues innovated including the use of total stations to systematically piece provenience excavated artifacts and buckets of sediments. The site monograph was published in 1995. The database was published in 1996 as a CD and subsequently appeared on-line at www.oldstoneage.com. Here a newly cleaned and reformatted version of this database is presented along with all available artifact images. The Combe Capelle project database is managed by Shannon McPherron.<br/></p>\\", \\"id\\": \\"7e2fa5e4-8763-42e2-8e14-40680c5c9980\\"}]", "date": "2020-03-30", "feed_image": 29, "location": "SRID=4326;POINT (0.8485597372123266 44.753506928295)", "is_public": false, "app_label": "cc", "carousel_items": [], "related_links": [], "tagged_items": []}	\N	42	4
247	f	2020-07-12 15:03:15.880769-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 1, "title": "Paleo Core", "draft_title": "Paleo Core", "slug": "standard", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-28T16:09:54.724Z", "last_published_at": "2020-07-12T21:59:58.839Z", "latest_revision_created_at": "2020-07-12T21:59:58.583Z", "live_revision": 246, "subtitle": "A data standard for paleoanthropology.", "intro": "<p>The Paleo Core standard is an implementation and extension of the Darwin Core standard for describing biodiversity data.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Paleo Core data standard is an implementation of Darwin Core for paleoanthropology that draws from the Darwin Core standard terms and from the ChronometricAge extension. Additionally, Paleo Core introduces new classes for archaeological and geological occurrences along with new attributes appropriate to these classes. These changes also precipitate minor reassignments of attributes between occurrence classes.</p>\\", \\"id\\": \\"dcae2f46-510f-41f2-9635-ef7e844651b9\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>This page provides an index to all the terms used by Paleo Core with links to their sources, commentary and examples for implementation of the terms for paleoanthropology and definitions for newly minted Paleo Core terms.</p><p>Given the broad range of information collected and utilized in paleoanthropology the metadata schemes are large and can be cumbersome. Paleo Core identifies a minimum subset of terms that reflect the most significant and consistently employed concepts in paleoanthropology based on an analysis of several active projects hosted at paleocore.org and in published data dictionaries.</p><p>namespace abbreviation: pc<br/>uri: https://paleocore.org/terms/<br/>website: https://paleocore.org/terms</p><p></p><hr/><p></p>\\", \\"id\\": \\"02927821-c9ca-41cd-8034-a9e61aa856c9\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Dublin Core</h2><h3>A metadata initiative for publications and online resources.</h3><p>namespace abbreviation: dcmi</p><p>uri: http://dublincore.org/2012/06/14/dcterms.rdf</p><p>WebVOWL visualization</p><p>website: http://dublincore.org</p><p></p><hr/><p></p>\\", \\"id\\": \\"9dda8231-d269-455d-a257-3fce1b831234\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2><a href=\\\\\\"https://dwc.tdwg.org/\\\\\\">Darwin Core</a></h2><h3>A metadata initiative for biodiversity.</h3><p>namespace abreviation: dwc</p><p>uri: http://rs.tdwg.org/dwc/terms/</p><p><a href=\\\\\\"https://dwc.tdwg.org/terms/\\\\\\">https://dwc.tdwg.org/terms/</a><br/></p><p></p><p></p><p>https://dwc.tdwg.org/terms/</p><p></p><p></p><p>Darwin Core Extensions</p><p>Darwin Core QA wiki</p><p>Darwin Core Webinars</p><p></p><hr/><p></p>\\", \\"id\\": \\"111d0578-adb7-4b7e-b8f0-8ce9d82b2f59\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>Chronometric Age</p><p>An registered Darwin Core extension to capture chronometric age information</p><p>website:\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extension.do?id=http://zooarchnet.org/dwc/terms/ChronometricAge\\\\\\">https://tools.gbif.org/dwca-validator/extension.do?id=http://zooarchnet.org/dwc/terms/ChronometricAge</a></p><hr/>\\", \\"id\\": \\"f4b3e1c1-b388-4996-9309-e8dbe27dde40\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Biological Collections Ontology</h2><h3>A biodiversity and collections ontology based on Darwin Core metadata terms.</h3><p>namespace abbreviation: bco<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><p></p><hr/><p></p>\\", \\"id\\": \\"bbf6322f-dc91-4cd1-9092-3481d3901323\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Friend of a Friend Ontology</h2><h3>An ontology for people, organizations and social networks.</h3><p>namespace abbreviation: foaf<br/>uri:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a></p><hr/><h2>Uberon Ontology</h2><h3>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.</h3><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
