185	f	2020-06-11 12:52:51.139369-07	{"pk": 38, "path": "00010001000B0005", "depth": 4, "numchild": 0, "title": "Mille-Logya Project", "draft_title": "Mille-Logya Project", "slug": "mlp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/mlp/", "owner": 4, "seo_title": "mlp", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:52:04.614Z", "last_published_at": "2020-06-11T19:52:20.259Z", "latest_revision_created_at": "2020-06-11T19:52:19.784Z", "live_revision": 184, "intro": "<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Mille-Logya Research Project (MLP) is a paleoanthropological research effort located in northeastern Ethiopia, just a few kilometers north of Hadar and Dikika. The project was initiated in 2014.\\\\\\\\\\\\\\\\u00a0The project is lead by Dr. Zeresenay Alemseged of the University of Chicago.\\\\\\\\\\\\\\\\u00a0&lt;/p&gt;&lt;p&gt;The data in the Mille-Logya Project are currently restricted to project members.<br/></p>\\", \\"id\\": \\"d68ec6af-538b-4cdf-84f2-4406081d722b\\"}]", "date": "2020-03-30", "feed_image": 38, "location": "SRID=4326;POINT (40.80999999999995 11.583)", "is_public": false, "app_label": "mlp", "carousel_items": [], "related_links": [], "tagged_items": []}	\N	38	4
