178	f	2020-06-11 12:10:57.997215-07	{"pk": 41, "path": "00010001000B0008", "depth": 4, "numchild": 0, "title": "Fontechevade", "draft_title": "Fontechevade", "slug": "fc", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/fc/", "owner": 4, "seo_title": "fc", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:58:19.217Z", "last_published_at": "2020-06-11T18:15:05.085Z", "latest_revision_created_at": "2020-06-11T18:15:04.812Z", "live_revision": 164, "intro": "<p>A Pleistocene archaeological site in France.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>Fontechevade is a cave site in the Charente region of southern France. It was best known from the excavations of G. Henri-Martin who excavated there from 1937 to 1954 and fully published the results. Based on this work, the site became the type site for the Tayacian stone tool industry. Tayacian is characterized by a rather non-descript technology and a high percentage of notched tools. The site was also known for two hominin fossil fragments. The site was re-excavated from 1994 to 1999 by a team from the University of Pennsylvania (Dibble, Chase and McPherron) and the University of Perpignan (Deb\\\\\\\\\\\\\\\\u00e9nath), and a monograph was published in 2009. The new excavations and a re-analysis of the Henri-Martin collection demonstrated that the Tayacian was a result of site formation processes, and that the majority of deposits in the cave contain very little evidence of hominin behaviors there. The excavations were conducted using the same methodologies that Dibble and colleagues developed at Combe-Capelle Bas. The full database can be found at www.oldstoneage.com. Here a further cleaned version of this database is provided along with artifact images.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;The Fontechevade data are currently restricted to project members.<br/></p>\\", \\"id\\": \\"b0e3351f-e845-4559-b261-6842d8722460\\"}]", "date": "2020-03-30", "feed_image": 34, "location": "SRID=4326;POINT (0.4803460836432123 45.682799187202)", "is_public": false, "app_label": "fc", "carousel_items": [], "related_links": [], "tagged_items": []}	\N	41	4
