106	f	2020-03-30 22:53:49.048762-07	{"pk": 39, "path": "00010001000B0006", "depth": 4, "numchild": 0, "title": "Ledi-Geraru Research Project (LGRP)", "draft_title": "Ledi-Geraru Research Project (LGRP)", "slug": "lgrp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/lgrp/", "owner": 4, "seo_title": "lgrp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "intro": "<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Ledi-Geraru Research Project was started in 2002. Research focuses on answering questions regarding the disappearance of &lt;i&gt;Australopithecus afarensis&lt;/i&gt; and the appearance of the genus &lt;i&gt;Homo&lt;/i&gt; in the time period from 2.95 Ma- 2.4 Ma. These questions are related to habitat and behavioral differences between the two species. Fossiliferous sediments of that age are fairly rare in the Lower Awash Valley, but are present in the Ledi-Geraru, as well as some deposits that are younger still.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;Co-leaders of the project are Kaye Reed, Ramon Arrowsmith, Christopher Campisano, and Brian Villmoare. Other participants include Lars Werdelin, Vera Aldeais, Marion Bamford, David Braun, Alan Deino, Erin DiMaggio, Guillaume Dupont-Nivet, David Feary, William Kimbel, Amy Rector, Joshua Robinson, William Archer, Blade Engda, Domnique Garello, Jacob Harris, Ignacio Lazagabaster, Ellis Locke, David Patterson, John Rowan, Chalachew Seyoum, Niguss Tsehay, Eric Scott, and Irene Smail.\\\\u00a0The data in the Ledi-Geraru Research Project are currently restricted to project members.</p>\\", \\"id\\": \\"467c2948-59d5-4b43-9c4d-f0e86bf33c4a\\"}]", "date": "2020-03-30", "feed_image": null, "location": "SRID=4326;POINT (11.351285 40.86023799999998)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	39	4
