248	f	2020-07-12 16:52:00.188204-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 1, "title": "Paleo Core", "draft_title": "Paleo Core", "slug": "standard", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-28T16:09:54.724Z", "last_published_at": "2020-07-12T22:03:16.138Z", "latest_revision_created_at": "2020-07-12T22:03:15.880Z", "live_revision": 247, "subtitle": "A data standard for paleoanthropology.", "intro": "<p>The Paleo Core standard is an implementation and extension of the Darwin Core standard for describing biodiversity data.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Paleo Core data standard is an implementation of Darwin Core for paleoanthropology that draws from the Darwin Core standard terms and from the ChronometricAge extension. Additionally, Paleo Core introduces new classes for archaeological and geological occurrences along with new attributes appropriate to these classes. These changes also precipitate minor reassignments of attributes between occurrence classes.</p>\\", \\"id\\": \\"dcae2f46-510f-41f2-9635-ef7e844651b9\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>This page provides an index to all the terms used by Paleo Core with links to their sources, commentary and examples for implementation of the terms for paleoanthropology, and definitions for newly minted Paleo Core terms.</p><p>Given the broad range of information collected and utilized in paleoanthropology the metadata schemes are large and can be cumbersome. Paleo Core identifies a minimum subset of terms that reflect the most significant and consistently employed concepts in paleoanthropology based on an analysis of several active projects hosted at paleocore.org and in published data dictionaries.</p><p>namespace:\\\\u00a0https://paleocore.org/terms/<br/>namespace abbreviation: pc<br/>website: https://paleocore.org/terms</p><p></p><hr/><p></p>\\", \\"id\\": \\"02927821-c9ca-41cd-8034-a9e61aa856c9\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Dublin Core</h2><h3>A metadata initiative for publications and online resources.</h3><p>namespace: http://purl.org/dc/terms/<br/>namespace abbreviation: dc<br/>website: http://dublincore.org</p><p></p><hr/><p></p>\\", \\"id\\": \\"9dda8231-d269-455d-a257-3fce1b831234\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2><a href=\\\\\\"https://dwc.tdwg.org/\\\\\\">Darwin Core</a></h2><h3>A metadata initiative for biodiversity.</h3><p>namespace:\\\\u00a0http://rs.tdwg.org/dwc/terms/<br/>namespace abreviation: dwc<br/>website:\\\\u00a0<a href=\\\\\\"https://dwc.tdwg.org/terms/\\\\\\">https://dwc.tdwg.org/terms/</a></p><hr/><p></p><p></p><p></p><p></p>\\", \\"id\\": \\"111d0578-adb7-4b7e-b8f0-8ce9d82b2f59\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Chronometric Age</h2><p>A registered Darwin Core extension to capture chronometric age information</p><p>website:\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extension.do?id=http://zooarchnet.org/dwc/terms/ChronometricAge\\\\\\">https://tools.gbif.org/dwca-validator/extension.do?id=http://zooarchnet.org/dwc/terms/ChronometricAge</a></p><p><p></p><p>https://tools.gbif.org/dwca-validator/extension.do?id=http://zooarchnet.org/dwc/terms/ChronometricAge</p></p><p></p><hr/>\\", \\"id\\": \\"f4b3e1c1-b388-4996-9309-e8dbe27dde40\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Biological Collections Ontology</h2><h3>A biodiversity and collections ontology based on Darwin Core metadata terms.</h3><p>namespace abbreviation: bco<br/>website:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><p></p><hr/><p></p>\\", \\"id\\": \\"bbf6322f-dc91-4cd1-9092-3481d3901323\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Friend of a Friend Ontology</h2><h3>An ontology for people, organizations and social networks.</h3><p>namespace:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/>namespace abbreviation: foaf<br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a></p><hr/><h2>Uberon Ontology</h2><h3>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.</h3><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
