//www.obofoundry.org/ontology/bco.html</p></p><p><p></p><p>http://purl.obolibrary.org/obo/bco.owl</p></p><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a><p></p><p></p><hr/><p></p>\\", \\"id\\": \\"bbf6322f-dc91-4cd1-9092-3481d3901323\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Friend of a Friend Ontology</h2><h3>An ontology for people, organizations and social networks.</h3><p>namespace:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/>namespace abbreviation: foaf<br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a></p><hr/><h2>Uberon Ontology</h2><h3>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.</h3><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
109	f	2020-03-30 22:54:43.510009-07	{"pk": 39, "path": "00010001000B0006", "depth": 4, "numchild": 0, "title": "Ledi-Geraru Research Project (lgrp)", "draft_title": "Ledi-Geraru Research Project (LGRP)", "slug": "lgrp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/lgrp/", "owner": 4, "seo_title": "lgrp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:53:49.201Z", "last_published_at": "2020-03-31T05:53:49.201Z", "latest_revision_created_at": "2020-03-31T05:53:49.048Z", "live_revision": 106, "intro": "<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Ledi-Geraru Research Project was started in 2002. Research focuses on answering questions regarding the disappearance of &lt;i&gt;Australopithecus afarensis&lt;/i&gt; and the appearance of the genus &lt;i&gt;Homo&lt;/i&gt; in the time period from 2.95 Ma- 2.4 Ma. These questions are related to habitat and behavioral differences between the two species. Fossiliferous sediments of that age are fairly rare in the Lower Awash Valley, but are present in the Ledi-Geraru, as well as some deposits that are younger still.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;Co-leaders of the project are Kaye Reed, Ramon Arrowsmith, Christopher Campisano, and Brian Villmoare. Other participants include Lars Werdelin, Vera Aldeais, Marion Bamford, David Braun, Alan Deino, Erin DiMaggio, Guillaume Dupont-Nivet, David Feary, William Kimbel, Amy Rector, Joshua Robinson, William Archer, Blade Engda, Domnique Garello, Jacob Harris, Ignacio Lazagabaster, Ellis Locke, David Patterson, John Rowan, Chalachew Seyoum, Niguss Tsehay, Eric Scott, and Irene Smail.\\\\u00a0The data in the Ledi-Geraru Research Project are currently restricted to project members.</p>\\", \\"id\\": \\"467c2948-59d5-4b43-9c4d-f0e86bf33c4a\\"}]", "date": "2020-03-30", "feed_image": null, "location": "SRID=4326;POINT (11.351285 40.86023799999998)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	39	4
97	f	2020-03-30 14:54:26.892357-07	{"pk": 33, "path": "00010001000B", "depth": 3, "numchild": 0, "title": "Paleo Core Projects", "draft_title": "Paleo Core Projects", "slug": "projects", "content_type": 105, "live": true, "has_unpublished_changes": false, "url_path": "/home/paleo-core-projects/", "owner": 4, "seo_title": "projects", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-30T21:54:03.019Z", "last_published_at": "2020-03-30T21:54:03.019Z", "latest_revision_created_at": "2020-03-30T21:54:02.717Z", "live_revision": 96, "intro": "", "related_links": []}	\N	33	4
