237	f	2020-07-08 08:57:36.592276-07	{"pk": 32, "path": "00010001000A", "depth": 3, "numchild": 0, "title": "About Paleo Core", "draft_title": "About Paleo Core", "slug": "about", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/about/", "owner": 4, "seo_title": "About", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-09T05:10:16.210Z", "last_published_at": "2020-07-08T15:56:49.051Z", "latest_revision_created_at": "2020-07-08T15:56:48.752Z", "live_revision": 236, "subtitle": "", "intro": "<h2>Mission</h2><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.</p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Mission</h2><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.</p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p>\\", \\"id\\": \\"2386a041-4968-4dcd-9c50-cbeda9afc271\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<p><embed alt=\\\\\\"logo3_400.png\\\\\\" embedtype=\\\\\\"image\\\\\\" format=\\\\\\"fullwidth\\\\\\" id=\\\\\\"17\\\\\\"/></p>\\", \\"id\\": \\"2b34b56d-3924-4d07-afb3-bee84324e43e\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Goals</h2><p></p><ol><li>to implement and extend data standards for paleoanthropology;<br/></li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;\\\\u00a0<br/></li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.<br/></li></ol><p></p>\\", \\"id\\": \\"84824cf2-a127-4a81-babf-31eee3b947cf\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>The Name</h2><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">Dublin Core</a>,\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">Darwin Core</a>\\\\u00a0and\\\\u00a0<a href=\\\\\\"http://www.tdwg.org/standards/115/download/ABCD_v206.html\\\\\\">Access to Biological Collections Data</a>\\\\u00a0(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p>\\", \\"id\\": \\"0af9c5b3-493c-4719-87c0-caf955ffe2f3\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	32	4
125	f	2020-04-09 16:27:53.322644-07	{"pk": 37, "path": "00010001000B0004", "depth": 4, "numchild": 0, "title": "Omo-Mursi Research Project", "draft_title": "Omo-Mursi Research Project", "slug": "omo-mursi", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/omo-mursi/", "owner": 4, "seo_title": "omo-mursi", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:50:47.389Z", "last_published_at": "2020-03-31T05:50:47.389Z", "latest_revision_created_at": "2020-03-31T05:50:47.123Z", "live_revision": 104, "intro": "<p>omo-mursi</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>omo-mursi</p>\\", \\"id\\": \\"5792cfb0-2452-4fe8-96e4-01544a253390\\"}]", "date": "2020-03-30", "feed_image": null, "location": "SRID=4326;POINT (36.00463807583401 4.9512564349795)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	37	4
250	f	2020-07-12 17:03:07.328242-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 1, "title": "Paleo Core", "draft_title": "Paleo Core", "slug": "standard", "content_type": 34, "live": true, "has_unpublished_changes": true, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-28T16:09:54.724Z", "last_published_at": "2020-07-12T22:03:16.138Z", "latest_revision_created_at": "2020-07-12T23:53:19.888Z", "live_revision": 247, "subtitle": "A data standard for paleoanthropology.", "intro": "<p>The Paleo Core standard is an implementation and extension of the Darwin Core standard for describing biodiversity data.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Paleo Core data standard is an implementation of Darwin Core for paleoanthropology that draws from the Darwin Core standard terms and from the ChronometricAge extension. Additionally, Paleo Core introduces new classes for archaeological and geological occurrences along with new attributes appropriate to these classes. These changes also precipitate minor reassignments of attributes between occurrence classes.</p>\\", \\"id\\": \\"dcae2f46-510f-41f2-9635-ef7e844651b9\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>This page provides an index to all the terms used by Paleo Core with links to their sources, commentary and examples for implementation of the terms for paleoanthropology, and definitions for newly minted Paleo Core terms.</p><p>Given the broad range of information collected and utilized in paleoanthropology the metadata schemes are large and can be cumbersome. Paleo Core identifies a minimum subset of terms that reflect the most significant and consistently employed concepts in paleoanthropology based on an analysis of several active projects hosted at paleocore.org and in published data dictionaries.</p><p>namespace:\\\\u00a0https://paleocore.org/terms/<br/>namespace abbreviation: pc<br/>website: https://paleocore.org/terms</p><p></p><hr/><p></p>\\", \\"id\\": \\"02927821-c9ca-41cd-8034-a9e61aa856c9\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Dublin Core</h2><h3>A metadata initiative for publications and online resources.</h3><p>namespace: http://purl.org/dc/terms/<br/>namespace abbreviation: dc<br/>website: http://dublincore.org</p><p></p><hr/><p></p>\\", \\"id\\": \\"9dda8231-d269-455d-a257-3fce1b831234\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2><a href=\\\\\\"https://dwc.tdwg.org/\\\\\\">Darwin Core</a></h2><h3>A metadata initiative for biodiversity.</h3><p>namespace:\\\\u00a0http://rs.tdwg.org/dwc/terms/<br/>namespace abreviation: dwc<br/>website:\\\\u00a0<a href=\\\\\\"https://dwc.tdwg.org/terms/\\\\\\">https://dwc.tdwg.org/terms/</a></p><hr/><p></p><p></p><p></p><p></p>\\", \\"id\\": \\"111d0578-adb7-4b7e-b8f0-8ce9d82b2f59\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Chronometric Age</h2><h3>A Darwin Core extension to capture chronometric age information</h3><p>website:\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extension.do?id=http://zooarchnet.org/dwc/terms/ChronometricAge\\\\\\">https://tools.gbif.org/dwca-validator/extension.do?id=http://zooarchnet.org/dwc/terms/ChronometricAge</a></p><hr/><p></p><p></p><p></p>\\", \\"id\\": \\"f4b3e1c1-b388-4996-9309-e8dbe27dde40\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Friend of a Friend Ontology</h2><h3>An ontology for people, organizations and social networks.</h3><p>namespace:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/>namespace abbreviation: foaf<br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a></p><hr/>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Biological Collections Ontology</h2><h3>A biodiversity and collections ontology based on Darwin Core metadata terms.</h3><p>namespace:\\\\u00a0http://purl.obolibrary.org/obo/bco.owl<br/>namespace abbreviation: bco<br/>website:\\\\u00a0<a href=\\\\\\"http://www.obofoundry.org/ontology/bco.html\\\\\\">http://www.obofoundry.org/ontology/bco.html</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><p></p><p></p><hr/><p></p>\\", \\"id\\": \\"bbf6322f-dc91-4cd1-9092-3481d3901323\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Uberon Ontology</h2><h3>An anatomical ontology with a focus on vertebrates.</h3><p>namespace:\\\\u00a0uri: http://purl.obolibrary.org/obo/uberon.owl<br/>namespace abbreviation: uberon</p><p>webpage:\\\\u00a0http://uberon.github.io/<p><p></p><p>http://uberon.github.io/</p></p><br/></p>\\", \\"id\\": \\"1e8e3c57-40a8-4e8c-8ae4-6dcfb551778a\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
