140	f	2020-04-09 17:08:32.235895-07	{"pk": 39, "path": "00010001000B0006", "depth": 4, "numchild": 0, "title": "Ledi-Geraru Research Project (lgrp)", "draft_title": "Ledi-Geraru Research Project (lgrp)", "slug": "lgrp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/lgrp/", "owner": 4, "seo_title": "lgrp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:53:49.201Z", "last_published_at": "2020-04-09T23:26:37.367Z", "latest_revision_created_at": "2020-04-09T23:26:37.190Z", "live_revision": 122, "intro": "<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Ledi-Geraru Research Project was started in 2002. Research focuses on answering questions regarding the disappearance of &lt;i&gt;Australopithecus afarensis&lt;/i&gt; and the appearance of the genus &lt;i&gt;Homo&lt;/i&gt; in the time period from 2.95 Ma- 2.4 Ma. These questions are related to habitat and behavioral differences between the two species. Fossiliferous sediments of that age are fairly rare in the Lower Awash Valley, but are present in the Ledi-Geraru, as well as some deposits that are younger still.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;Co-leaders of the project are Kaye Reed, Ramon Arrowsmith, Christopher Campisano, and Brian Villmoare. Other participants include Lars Werdelin, Vera Aldeais, Marion Bamford, David Braun, Alan Deino, Erin DiMaggio, Guillaume Dupont-Nivet, David Feary, William Kimbel, Amy Rector, Joshua Robinson, William Archer, Blade Engda, Domnique Garello, Jacob Harris, Ignacio Lazagabaster, Ellis Locke, David Patterson, John Rowan, Chalachew Seyoum, Niguss Tsehay, Eric Scott, and Irene Smail.\\\\u00a0The data in the Ledi-Geraru Research Project are currently restricted to project members.</p>\\", \\"id\\": \\"467c2948-59d5-4b43-9c4d-f0e86bf33c4a\\"}]", "date": "2020-03-30", "feed_image": 31, "location": "SRID=4326;POINT (40.86023799999998 11.351285)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	39	4
165	f	2020-06-11 11:18:07.955651-07	{"pk": 42, "path": "00010001000B0009", "depth": 4, "numchild": 0, "title": "Combe-Capelle Bas", "draft_title": "Combe-Capelle Bas", "slug": "cc", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/cc/", "owner": 4, "seo_title": "cc", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:59:35.962Z", "last_published_at": "2020-06-09T18:58:54.804Z", "latest_revision_created_at": "2020-06-09T18:58:54.473Z", "live_revision": 163, "intro": "<p>A Pleistocene archaeological site in France.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>Combe-Capelle Bas is one of a several sites at Combe-Capelle. It is an open-air site located at the base of a terraced slope of the Couze valley in southwest France. Until recently, the site was best known from the excavations of Ami who worked there until 1931 and discovered a series of Middle Paleolithic assemblages. In 1987, Dibble and Lenoir started new excavations at the site. In four seasons they re-sampled deposits along Ami&#39;s excavation trench and tested briefly another of the Combe-Capelle sites, Abri Peyrony. The new excavations were conducted following methods that Dibble and colleagues innovated including the use of total stations to systematically piece provenience excavated artifacts and buckets of sediments. The site monograph was published in 1995. The database was published in 1996 as a CD and subsequently appeared on-line at www.oldstoneage.com. Here a newly cleaned and reformatted version of this database is presented along with all available artifact images. The Combe Capelle project database is managed by Shannon McPherron.<br/></p>\\", \\"id\\": \\"7e2fa5e4-8763-42e2-8e14-40680c5c9980\\"}]", "date": "2020-03-30", "feed_image": 29, "location": "SRID=4326;POINT (0.8485597372123266 44.753506928295)", "is_public": false, "app_label": "cc", "carousel_items": [], "related_links": [], "tagged_items": []}	\N	42	4
99	f	2020-03-30 21:00:34.97358-07	{"pk": 34, "path": "00010001000B0001", "depth": 4, "numchild": 0, "title": "Eyasi Plateau Paleontology Project (EPPE)", "draft_title": "Eyasi Plateau Paleontology Project (EPPE)", "slug": "eyasi-plateau-paleontology-project-eppe", "content_type": 104, "live": false, "has_unpublished_changes": true, "url_path": "/home/projects/eyasi-plateau-paleontology-project-eppe/", "owner": 4, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": "2020-03-31T04:00:28.438Z", "live_revision": null, "intro": "<p>The EPPE Laeotoli specimen database contains 13713 records of plant and animal fossils (ca. 28248 specimens) collected by EPPE field teams working at Laetoli, Tanzania. This database is a digital version of the original hard-copy specimen catalog and documents the discovery, stratigraphic provenience and taxonomic diversity of Pliocene and Pleistocene fauna and flora in\\u00a0 northern Tanzania in the time range between 3.7 Ma to 200 ka. The collections include important lectotypes for\\u00a0<i>Australopithecus afarensis</i>, the first record of\\u00a0<i>Paranthropus aethiopicus</i>\\u00a0outside Kenya and early records of our own species\\u00a0<i>Homo sapiens</i>. The taxonomic identifications appearing in this dataset are the original field identifications and are provisional. Any taxonomic analysis employing this dataset should refer to updated identifications published by specialists in the appropriate taxonomic domain (e.g. Harrison 2011).\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The EPPE Laeotoli specimen database contains 13713 records of plant and animal fossils (ca. 28248 specimens) collected by EPPE field teams working at Laetoli, Tanzania. This database is a digital version of the original hard-copy specimen catalog and documents the discovery, stratigraphic provenience and taxonomic diversity of Pliocene and Pleistocene fauna and flora in\\\\u00a0 northern Tanzania in the time range between 3.7 Ma to 200 ka. The collections include important lectotypes for\\\\u00a0<i>Australopithecus afarensis</i>, the first record of\\\\u00a0<i>Paranthropus aethiopicus</i>\\\\u00a0outside Kenya and early records of our own species\\\\u00a0<i>Homo sapiens</i>. The taxonomic identifications appearing in this dataset are the original field identifications and are provisional. Any taxonomic analysis employing this dataset should refer to updated identifications published by specialists in the appropriate taxonomic domain (e.g. Harrison 2011).\\\\u00a0</p>\\", \\"id\\": \\"49fe291c-91d2-44ad-b5ca-27f1ae72b726\\"}]", "date": "2020-03-30", "feed_image": null, "location": null, "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	34	4
251	f	2020-07-12 17:06:34.977116-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 1, "title": "Paleo Core Standard", "draft_title": "Paleo Core", "slug": "standard", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-28T16:09:54.724Z", "last_published_at": "2020-07-13T00:03:07.626Z", "latest_revision_created_at": "2020-07-13T00:03:07.328Z", "live_revision": 250, "subtitle": "A data standard for paleoanthropology.", "intro": "<p>The Paleo Core standard is an implementation and extension of the Darwin Core standard for describing biodiversity data.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Paleo Core data standard is an implementation of Darwin Core for paleoanthropology that draws from the Darwin Core standard terms and from the ChronometricAge extension. Additionally, Paleo Core introduces new classes for archaeological and geological occurrences along with new attributes appropriate to these classes. These changes also precipitate minor reassignments of attributes between occurrence classes.</p>\\", \\"id\\": \\"dcae2f46-510f-41f2-9635-ef7e844651b9\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>This page provides an index to all the terms used by Paleo Core with links to their sources, commentary and examples for implementation of the terms for paleoanthropology, and definitions for newly minted Paleo Core terms.</p><p>Given the broad range of information collected and utilized in paleoanthropology the metadata schemes are large and can be cumbersome. Paleo Core identifies a minimum subset of terms that reflect the most significant and consistently employed concepts in paleoanthropology based on an analysis of several active projects hosted at paleocore.org and in published data dictionaries.</p><p>namespace:\\\\u00a0https://paleocore.org/terms/<br/>namespace abbreviation: pc<br/>website: https://paleocore.org/terms</p><p></p><hr/><p></p>\\", \\"id\\": \\"02927821-c9ca-41cd-8034-a9e61aa856c9\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2><a href=\\\\\\"http://dublincore.org\\\\\\">Dublin Core</a></h2><h3>A metadata initiative for publications and online resources.</h3><p>namespace: http://purl.org/dc/terms/<br/>namespace abbreviation: dc<br/>website: http://dublincore.org</p><p></p><hr/><p></p>\\", \\"id\\": \\"9dda8231-d269-455d-a257-3fce1b831234\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2><a href=\\\\\\"https://dwc.tdwg.org/\\\\\\">Darwin Core</a></h2><h3>A metadata initiative for biodiversity.</h3><p>namespace:\\\\u00a0http://rs.tdwg.org/dwc/terms/<br/>namespace abreviation: dwc<br/>website:\\\\u00a0<a href=\\\\\\"https://dwc.tdwg.org/terms/\\\\\\">https://dwc.tdwg.org/terms/</a></p><hr/><p></p><p></p><p></p><p></p>\\", \\"id\\": \\"111d0578-adb7-4b7e-b8f0-8ce9d82b2f59\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2><a href=\\\\\\"https://tools.gbif.org/dwca-validator/extension.do?id=http://zooarchnet.org/dwc/terms/ChronometricAge\\\\\\">Chronometric Age</a></h2><h3>A Darwin Core extension to capture chronometric age information</h3><p>website:\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extension.do?id=http://zooarchnet.org/dwc/terms/ChronometricAge\\\\\\">https://tools.gbif.org/dwca-validator/extension.do?id=http://zooarchnet.org/dwc/terms/ChronometricAge</a></p><hr/><p></p><p></p><p></p>\\", \\"id\\": \\"f4b3e1c1-b388-4996-9309-e8dbe27dde40\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2><a href=\\\\\\"http://xmlns.com/foaf/spec/\\\\\\">Friend of a Friend Ontology</a></h2><h3>An ontology for people, organizations and social networks.</h3><p>namespace:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/>namespace abbreviation: foaf<br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a></p><hr/>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2><a href=\\\\\\"http://www.obofoundry.org/ontology/bco.html\\\\\\">Biological Collections Ontology</a></h2><h3>A biodiversity and collections ontology based on Darwin Core metadata terms.</h3><p>namespace:\\\\u00a0http://purl.obolibrary.org/obo/bco.owl<br/>namespace abbreviation: bco<br/>website:\\\\u00a0<a href=\\\\\\"http://www.obofoundry.org/ontology/bco.html\\\\\\">http://www.obofoundry.org/ontology/bco.html</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><p></p><p></p><hr/><p></p>\\", \\"id\\": \\"bbf6322f-dc91-4cd1-9092-3481d3901323\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2><a href=\\\\\\"http://uberon.github.io/\\\\\\">Uberon Ontology</a></h2><h3>An anatomical ontology with a focus on vertebrates.</h3><p>namespace:\\\\u00a0uri: http://purl.obolibrary.org/obo/uberon.owl<br/>namespace abbreviation: uberon<br/>webpage:\\\\u00a0http://uberon.github.io/</p><p></p><p></p><p><br/></p><p></p>\\", \\"id\\": \\"1e8e3c57-40a8-4e8c-8ae4-6dcfb551778a\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
113	f	2020-03-30 22:59:35.810154-07	{"pk": 42, "path": "00010001000B0009", "depth": 4, "numchild": 0, "title": "Combe-Capelle Bas (cc)", "draft_title": "Combe-Capelle Bas (cc)", "slug": "combe-capelle-bas-cc", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/combe-capelle-bas-cc/", "owner": 4, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "intro": "<p>A Pleistocene archaeological site in France.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>Combe-Capelle Bas is one of a several sites at Combe-Capelle. It is an open-air site located at the base of a terraced slope of the Couze valley in southwest France. Until recently, the site was best known from the excavations of Ami who worked there until 1931 and discovered a series of Middle Paleolithic assemblages. In 1987, Dibble and Lenoir started new excavations at the site. In four seasons they re-sampled deposits along Ami\\\\\\\\\\\\\\\\u2019s excavation trench and tested briefly another of the Combe-Capelle sites, Abri Peyrony. The new excavations were conducted following methods that Dibble and colleagues innovated including the use of total stations to systematically piece provenience excavated artifacts and buckets of sediments. The site monograph was published in 1995. The database was published in 1996 as a CD and subsequently appeared on-line at www.oldstoneage.com. Here a newly cleaned and reformatted version of this database is presented along with all available artifact images.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;The Combe Capelle project database is managed by Shannon McPherron&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;The data in the Combe Capelle are currently restricted to project members.<br/></p>\\", \\"id\\": \\"7e2fa5e4-8763-42e2-8e14-40680c5c9980\\"}]", "date": "2020-03-30", "feed_image": null, "location": "SRID=4326;POINT (44.753506928295 0.8485597372123266)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	42	4
139	f	2020-04-09 17:05:36.739385-07	{"pk": 40, "path": "00010001000B0007", "depth": 4, "numchild": 0, "title": "Great Divide Basin (gdb)", "draft_title": "Great Divide Basin (gdb)", "slug": "gdb", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/gdb/", "owner": 4, "seo_title": "gdb", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:56:50.038Z", "last_published_at": "2020-04-09T23:27:29.121Z", "latest_revision_created_at": "2020-04-09T23:27:28.832Z", "live_revision": 124, "intro": "<p>A Paleogene site in central North America.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Great Divide Basin (GDB) Project collects and studies mammalian fossils across the Paleocene-Eocene boundary (ca. 55 mya) in southern Wyoming. In addition, we apply tools and techniques from the geographic information sciences (e.g., satellite imagery, drones, photogrammetry, and LiDAR) to generate predictive models for the location of fossil localities.&lt;/p&gt;&lt;p&gt;The project is led by Dr. Robert Anemone of the University of North Carolina at Greensboro. Core team members include remote sensing specialist Jay Emerson, biological anthropologist Brett Nachman, geologist Ron Watkins and vertebrate paleontologist Michele Stocker. Photo credit: David Wilson&lt;/p&gt;&lt;p&gt;The data in the Great Divide Basin are currently restricted to project members.<br/></p>\\", \\"id\\": \\"712208fc-2c6e-4183-a533-ab1bdbab20e7\\"}]", "date": "2020-03-30", "feed_image": 30, "location": "SRID=4326;POINT (-90 42.008)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	40	4
