202	f	2020-06-28 09:09:44.017206-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 0, "title": "Paleo Core Standards", "draft_title": "Paleo Core Standards", "slug": "standard", "content_type": 34, "live": false, "has_unpublished_changes": true, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": "2020-06-28T16:09:41.035Z", "live_revision": null, "subtitle": "", "intro": "<p>Paleo Core draws upon standard terms to allow the free exchange of information between research teams. Paleo Core draws from the standards, ontologies and vocabularies listed below.\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Dublin Core</h3><p>A metadata initiative for publications and online resources.</p><p>namespace abbreviation: dcmi<br/>uri:\\\\u00a0<a href=\\\\\\"http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">http://dublincore.org/2012/06/14/dcterms.rdf</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">WebVOWL visualization</a><br/>website:\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">http://dublincore.org</a></p><h3>Darwin Core<br/></h3><p>A metadata initiative for biodiversity.</p><p>namespace abreviation: dwc<br/>uri:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">http://rs.tdwg.org/dwc/terms/</a><br/>website:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/\\\\\\">http://rs.tdwg.org</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extensions.do\\\\\\">Extensions</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa\\\\\\">QA wiki</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa/wiki/Webinars\\\\\\">Webinars</a></p><p></p><h3>Biological Collections Ontology</h3><p></p><p>An biodiversity and collections ontology based on Darwin Core metadata terms.</p><p>namespace abbreviation: bco<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><h3>Friend of a Friend Ontology</h3><p>An ontology for people, organizations and social networks.</p><p>namespace abbreviation: foaf<br/>uri:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a><br/></p><h3>Paleo Core</h3><p>A Metadata initiative for paleoanthropology.</p><p>namespace abbreviation: pc</p><p>The listing and documentation for Paleo Core terms is being revised and coordinated with the efforts of the TDWG Paleo interest group. Feel free to follow or contribute to the group&#39;s progress on\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/paleo\\\\\\">github</a>.</p><h3>Uberon Ontology</h3><p>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.<br/></p><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
72	f	2020-03-08 22:10:45.024986-07	{"pk": 32, "path": "00010001000A", "depth": 3, "numchild": 0, "title": "About Paleo Core", "draft_title": "About Paleo Core", "slug": "about-paleo-core", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/about-paleo-core/", "owner": 4, "seo_title": "About PC", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-09T05:10:16.210Z", "last_published_at": "2020-03-09T05:10:16.210Z", "latest_revision_created_at": "2020-03-09T05:10:16.054Z", "live_revision": 71, "subtitle": "", "intro": "", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Mission</h2><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.<br/></p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p>\\", \\"id\\": \\"b7f739e5-f335-4b5a-a52e-51cf1f2dfa75\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Goals</h2><p></p><ol><li>to implement and extend data standards for paleoanthropology;<br/></li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;\\\\u00a0<br/></li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.<br/></li></ol><p></p>\\", \\"id\\": \\"84824cf2-a127-4a81-babf-31eee3b947cf\\"}, {\\"type\\": \\"image\\", \\"value\\": 15, \\"id\\": \\"365945de-8836-42da-9084-c7255650e7b8\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>The Name</h2><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">Dublin Core</a>,\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">Darwin Core</a>\\\\u00a0and\\\\u00a0<a href=\\\\\\"http://www.tdwg.org/standards/115/download/ABCD_v206.html\\\\\\">Access to Biological Collections Data</a>\\\\u00a0(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p>\\", \\"id\\": \\"0af9c5b3-493c-4719-87c0-caf955ffe2f3\\"}]", "template_string": "pages/standard_page.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	32	4
152	f	2020-06-06 16:34:33.255354-07	{"pk": 40, "path": "00010001000B0007", "depth": 4, "numchild": 0, "title": "Great Divide Basin (gdb)", "draft_title": "Great Divide Basin (gdb)", "slug": "gdb", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/gdb/", "owner": 4, "seo_title": "gdb", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:56:50.038Z", "last_published_at": "2020-05-13T23:10:00.688Z", "latest_revision_created_at": "2020-05-13T23:10:00.450Z", "live_revision": 147, "intro": "<p>A Paleogene site in central North America.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Great Divide Basin (GDB) Project collects and studies mammalian fossils across the Paleocene-Eocene boundary (ca. 55 mya) in southern Wyoming. In addition, we apply tools and techniques from the geographic information sciences (e.g., satellite imagery, drones, photogrammetry, and LiDAR) to generate predictive models for the location of fossil localities.&lt;/p&gt;&lt;p&gt;The project is led by Dr. Robert Anemone of the University of North Carolina at Greensboro. Core team members include remote sensing specialist Jay Emerson, biological anthropologist Brett Nachman, geologist Ron Watkins and vertebrate paleontologist Michele Stocker. Photo credit: David Wilson&lt;/p&gt;&lt;p&gt;The data in the Great Divide Basin are currently restricted to project members.<br/></p>\\", \\"id\\": \\"712208fc-2c6e-4183-a533-ab1bdbab20e7\\"}]", "date": "2020-03-30", "feed_image": 30, "location": "SRID=4326;POINT (-107.798 42.008)", "is_public": false, "app_label": "gdb", "carousel_items": [], "related_links": [], "tagged_items": []}	\N	40	4
