240	f	2020-07-08 13:52:21.80256-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 1, "title": "Paleo Core Standards", "draft_title": "Paleo Core Standards", "slug": "standard", "content_type": 34, "live": true, "has_unpublished_changes": true, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-28T16:09:54.724Z", "last_published_at": "2020-06-28T16:09:54.724Z", "latest_revision_created_at": "2020-07-08T20:50:30.557Z", "live_revision": 204, "subtitle": "", "intro": "<p>Paleo Core draws upon standard terms to allow the free exchange of information between research teams. Paleo Core draws from the standards, ontologies and vocabularies listed below.\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Dublin Core</h3><p>A metadata initiative for publications and online resources.</p><p>namespace abbreviation: dcmi<br/>uri:\\\\u00a0<a href=\\\\\\"http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">http://dublincore.org/2012/06/14/dcterms.rdf</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">WebVOWL visualization</a><br/>website:\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">http://dublincore.org</a></p><h3>Darwin Core<br/></h3><p>A metadata initiative for biodiversity.</p><p>namespace abreviation: dwc<br/>uri:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">http://rs.tdwg.org/dwc/terms/</a><br/>website:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/\\\\\\">http://rs.tdwg.org</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extensions.do\\\\\\">Extensions</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa\\\\\\">QA wiki</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa/wiki/Webinars\\\\\\">Webinars</a></p><p></p><h3>Biological Collections Ontology</h3><p></p><p>An biodiversity and collections ontology based on Darwin Core metadata terms.</p><p>namespace abbreviation: bco<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><h3>Friend of a Friend Ontology</h3><p>An ontology for people, organizations and social networks.</p><p>namespace abbreviation: foaf<br/>uri:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a><br/></p><h3>Paleo Core</h3><p>A Metadata initiative for paleoanthropology.</p><p>namespace abbreviation: pc<br/>uri: https://paleocore.org/pc/terms/<br/>website: https://paleocore.org/standards/pc<br/><br/></p><h3>Uberon Ontology</h3><p>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.<br/></p><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
71	f	2020-03-08 22:10:16.054041-07	{"pk": 32, "path": "00010001000A", "depth": 3, "numchild": 0, "title": "About Paleo Core", "draft_title": "About Paleo Core", "slug": "about-paleo-core", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/about-paleo-core/", "owner": 4, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "subtitle": "", "intro": "", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Mission</h2><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.<br/></p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p>\\", \\"id\\": \\"b7f739e5-f335-4b5a-a52e-51cf1f2dfa75\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Goals</h2><p></p><ol><li>to implement and extend data standards for paleoanthropology;<br/></li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;\\\\u00a0<br/></li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.<br/></li></ol><p></p>\\", \\"id\\": \\"84824cf2-a127-4a81-babf-31eee3b947cf\\"}, {\\"type\\": \\"image\\", \\"value\\": 15, \\"id\\": \\"365945de-8836-42da-9084-c7255650e7b8\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>The Name</h2><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">Dublin Core</a>,\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">Darwin Core</a>\\\\u00a0and\\\\u00a0<a href=\\\\\\"http://www.tdwg.org/standards/115/download/ABCD_v206.html\\\\\\">Access to Biological Collections Data</a>\\\\u00a0(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p>\\", \\"id\\": \\"0af9c5b3-493c-4719-87c0-caf955ffe2f3\\"}]", "template_string": "pages/standard_page.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	32	4
204	f	2020-06-28 09:09:54.515821-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 0, "title": "Paleo Core Standards", "draft_title": "Paleo Core Standards", "slug": "standard", "content_type": 34, "live": false, "has_unpublished_changes": true, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": "2020-06-28T16:09:49.407Z", "live_revision": null, "subtitle": "", "intro": "<p>Paleo Core draws upon standard terms to allow the free exchange of information between research teams. Paleo Core draws from the standards, ontologies and vocabularies listed below.\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Dublin Core</h3><p>A metadata initiative for publications and online resources.</p><p>namespace abbreviation: dcmi<br/>uri:\\\\u00a0<a href=\\\\\\"http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">http://dublincore.org/2012/06/14/dcterms.rdf</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">WebVOWL visualization</a><br/>website:\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">http://dublincore.org</a></p><h3>Darwin Core<br/></h3><p>A metadata initiative for biodiversity.</p><p>namespace abreviation: dwc<br/>uri:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">http://rs.tdwg.org/dwc/terms/</a><br/>website:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/\\\\\\">http://rs.tdwg.org</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extensions.do\\\\\\">Extensions</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa\\\\\\">QA wiki</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa/wiki/Webinars\\\\\\">Webinars</a></p><p></p><h3>Biological Collections Ontology</h3><p></p><p>An biodiversity and collections ontology based on Darwin Core metadata terms.</p><p>namespace abbreviation: bco<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><h3>Friend of a Friend Ontology</h3><p>An ontology for people, organizations and social networks.</p><p>namespace abbreviation: foaf<br/>uri:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a><br/></p><h3>Paleo Core</h3><p>A Metadata initiative for paleoanthropology.</p><p>namespace abbreviation: pc</p><p>The listing and documentation for Paleo Core terms is being revised and coordinated with the efforts of the TDWG Paleo interest group. Feel free to follow or contribute to the group&#39;s progress on\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/paleo\\\\\\">github</a>.</p><h3>Uberon Ontology</h3><p>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.<br/></p><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
216	f	2020-06-29 11:41:31.512215-07	{"pk": 51, "path": "00010001000F0003", "depth": 4, "numchild": 0, "title": "Example Documents Index", "draft_title": "Example Documents Index", "slug": "example-documents-index", "content_type": 71, "live": true, "has_unpublished_changes": false, "url_path": "/home/example-site/example-documents-index/", "owner": 4, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "intro": "<p>Example intro. Well, the way they make shows is, they make one show. That show&#39;s called a pilot. Then they show that show to the people who make shows, and on the strength of that one show they decide if they&#39;re going to make more shows. Some pilots get picked and become television programs. Some don&#39;t, become nothing. She starred in one of the ones that became nothing.</p>", "feed_image": null}	\N	51	4
161	f	2020-06-09 08:06:50.223315-07	{"pk": 39, "path": "00010001000B0006", "depth": 4, "numchild": 0, "title": "Ledi-Geraru Research Project", "draft_title": "Ledi-Geraru Research Project (lgrp)", "slug": "lgrp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/lgrp/", "owner": 4, "seo_title": "lgrp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:53:49.201Z", "last_published_at": "2020-06-07T02:15:38.678Z", "latest_revision_created_at": "2020-06-07T02:15:38.390Z", "live_revision": 157, "intro": "<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Ledi-Geraru Research Project was started in 2002. Research focuses on answering questions regarding the disappearance of &lt;i&gt;Australopithecus afarensis&lt;/i&gt; and the appearance of the genus &lt;i&gt;Homo&lt;/i&gt; in the time period from 2.95 Ma- 2.4 Ma. These questions are related to habitat and behavioral differences between the two species. Fossiliferous sediments of that age are fairly rare in the Lower Awash Valley, but are present in the Ledi-Geraru, as well as some deposits that are younger still.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;Co-leaders of the project are Kaye Reed, Ramon Arrowsmith, Christopher Campisano, and Brian Villmoare. Other participants include Lars Werdelin, Vera Aldeais, Marion Bamford, David Braun, Alan Deino, Erin DiMaggio, Guillaume Dupont-Nivet, David Feary, William Kimbel, Amy Rector, Joshua Robinson, William Archer, Blade Engda, Domnique Garello, Jacob Harris, Ignacio Lazagabaster, Ellis Locke, David Patterson, John Rowan, Chalachew Seyoum, Niguss Tsehay, Eric Scott, and Irene Smail.\\\\u00a0The data in the Ledi-Geraru Research Project are currently restricted to project members.</p>\\", \\"id\\": \\"467c2948-59d5-4b43-9c4d-f0e86bf33c4a\\"}]", "date": "2020-03-30", "feed_image": 31, "location": "SRID=4326;POINT (40.86023799999998 11.351285)", "is_public": false, "app_label": "lgrp", "carousel_items": [], "related_links": [], "tagged_items": []}	\N	39	4
123	f	2020-04-09 16:27:05.749858-07	{"pk": 38, "path": "00010001000B0005", "depth": 4, "numchild": 0, "title": "Mille-Logya Project (mlp)", "draft_title": "Mille-Logya Project (mlp)", "slug": "mlp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/mlp/", "owner": 4, "seo_title": "mlp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:52:04.614Z", "last_published_at": "2020-03-31T05:54:30.874Z", "latest_revision_created_at": "2020-03-31T05:54:30.558Z", "live_revision": 108, "intro": "<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Mille-Logya Research Project (MLP) is a paleoanthropological research effort located in northeastern Ethiopia, just a few kilometers north of Hadar and Dikika. The project was initiated in 2014.\\\\\\\\\\\\\\\\u00a0The project is lead by Dr. Zeresenay Alemseged of the University of Chicago.\\\\\\\\\\\\\\\\u00a0&lt;/p&gt;&lt;p&gt;The data in the Mille-Logya Project are currently restricted to project members.<br/></p>\\", \\"id\\": \\"d68ec6af-538b-4cdf-84f2-4406081d722b\\"}]", "date": "2020-03-30", "feed_image": null, "location": "SRID=4326;POINT (40.80999999999995 11.583)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	38	4
217	f	2020-06-29 11:42:46.578605-07	{"pk": 52, "path": "00010001000F0004", "depth": 4, "numchild": 0, "title": "Example FAQ", "draft_title": "Example FAQ", "slug": "example-faq", "content_type": 28, "live": true, "has_unpublished_changes": false, "url_path": "/home/example-site/example-faq/", "owner": 4, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "body": "[{\\"type\\": \\"faq_question\\", \\"value\\": \\"Why is this example page so useful?\\", \\"id\\": \\"c23eff53-3d1f-411a-809b-c25441432371\\"}, {\\"type\\": \\"faq_answer\\", \\"value\\": \\"<p>You think water moves fast? You should see ice. It moves like it has a mind. Like it knows it killed the world once and got a taste for murder. After the avalanche, it took us a week to climb out. Now, I don&#39;t know exactly when we turned on each other, but I know that seven of us survived the slide... and only five made it out. Now we took an oath, that I&#39;m breaking now. We said we&#39;d say it was the snow that killed the other two, but it wasn&#39;t. Nature is lethal but it doesn&#39;t hold a candle to man.<br/></p>\\", \\"id\\": \\"0386c5ca-e51d-4cc2-83e4-9c805be14ea5\\"}]"}	\N	52	4
