126	f	2020-04-09 16:28:13.818703-07	{"pk": 37, "path": "00010001000B0004", "depth": 4, "numchild": 0, "title": "Omo-Mursi Research Project (omo-mursi)", "draft_title": "Omo-Mursi Research Project", "slug": "omo-mursi", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/omo-mursi/", "owner": 4, "seo_title": "omo-mursi", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:50:47.389Z", "last_published_at": "2020-04-09T23:27:53.516Z", "latest_revision_created_at": "2020-04-09T23:27:53.322Z", "live_revision": 125, "intro": "<p>omo-mursi</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>omo-mursi</p>\\", \\"id\\": \\"5792cfb0-2452-4fe8-96e4-01544a253390\\"}]", "date": "2020-03-30", "feed_image": null, "location": "SRID=4326;POINT (36.00463807583401 4.9512564349795)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	37	4
83	f	2020-03-26 12:44:02.532004-07	{"pk": 32, "path": "00010001000A", "depth": 3, "numchild": 0, "title": "About Paleo Core", "draft_title": "About Paleo Core", "slug": "about", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/about/", "owner": 4, "seo_title": "About", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-09T05:10:16.210Z", "last_published_at": "2020-03-26T19:43:08.863Z", "latest_revision_created_at": "2020-03-26T19:43:08.660Z", "live_revision": 82, "subtitle": "", "intro": "", "body": "[{\\"type\\": \\"image\\", \\"value\\": 15, \\"id\\": \\"365945de-8836-42da-9084-c7255650e7b8\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Mission</h2><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.<br/></p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p>\\", \\"id\\": \\"b7f739e5-f335-4b5a-a52e-51cf1f2dfa75\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Goals</h2><p></p><ol><li>to implement and extend data standards for paleoanthropology;<br/></li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;\\\\u00a0<br/></li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.<br/></li></ol><p></p>\\", \\"id\\": \\"84824cf2-a127-4a81-babf-31eee3b947cf\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>The Name</h2><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">Dublin Core</a>,\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">Darwin Core</a>\\\\u00a0and\\\\u00a0<a href=\\\\\\"http://www.tdwg.org/standards/115/download/ABCD_v206.html\\\\\\">Access to Biological Collections Data</a>\\\\u00a0(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p>\\", \\"id\\": \\"0af9c5b3-493c-4719-87c0-caf955ffe2f3\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	32	4
