154	f	2020-06-06 16:35:29.647326-07	{"pk": 35, "path": "00010001000B0002", "depth": 4, "numchild": 0, "title": "Dikika Research Project (drp)", "draft_title": "Dikika Research Project (drp)", "slug": "drp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/drp/", "owner": 4, "seo_title": "drp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:46:39.803Z", "last_published_at": "2020-04-10T00:13:06.817Z", "latest_revision_created_at": "2020-04-10T00:13:06.466Z", "live_revision": 143, "intro": "<p>A Pliocene Site in Ethiopia</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Dikika Research Project (DRP) studies Pliocene hominins and paleoenvironments in the Afar Region of northeastern Ethiopia. Dikika is best known for the 3.3 Ma juvenile &lt;i&gt;Australopithecus afarensis&lt;/i&gt; fossil known as \\\\\\\\\\\\\\\\\\\\\\\\&quot;Selam\\\\\\\\\\\\\\\\\\\\\\\\&quot;. Selam is the most complete fossil skeleton of this species and one of just a handful of juvenile hominin fossil skeletons known.&lt;/p&gt;&lt;p&gt;The project is lead by Dr. Zeresenay Alemseged of the University of Chicago. Core DRP team members include: Zeresenay Alemseged, Andrew Barr, Ren\\\\\\\\\\\\\\\\u00e9 Bobe, Denis Geraads, Shannon McPherron, Denn\\\\\\\\\\\\\\\\u00e9 Reed, and Jonathan Wynn.\\\\\\\\\\\\\\\\u00a0&lt;/p&gt;&lt;p&gt;The data in the Dikika Research Project are currently restricted to project members.</p>\\", \\"id\\": \\"029ce7d4-63ac-4a87-ba3d-b29690e0b143\\"}]", "date": "2020-03-30", "feed_image": 25, "location": "SRID=4326;POINT (40.61900000000003 11.09)", "is_public": false, "app_label": "drp", "carousel_items": [], "related_links": [], "tagged_items": []}	\N	35	4
