127	f	2020-04-09 16:28:42.734459-07	{"pk": 35, "path": "00010001000B0002", "depth": 4, "numchild": 0, "title": "Dikika Research Project (DRP)", "draft_title": "Dikika Research Project (DRP)", "slug": "drp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/drp/", "owner": 4, "seo_title": "drp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:46:39.803Z", "last_published_at": "2020-03-31T05:46:59.202Z", "latest_revision_created_at": "2020-03-31T05:46:59.011Z", "live_revision": 102, "intro": "<p>A Pliocene Site in Ethiopia</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Dikika Research Project (DRP) studies Pliocene hominins and paleoenvironments in the Afar Region of northeastern Ethiopia. Dikika is best known for the 3.3 Ma juvenile &lt;i&gt;Australopithecus afarensis&lt;/i&gt; fossil known as \\\\\\\\\\\\\\\\\\\\\\\\&quot;Selam\\\\\\\\\\\\\\\\\\\\\\\\&quot;. Selam is the most complete fossil skeleton of this species and one of just a handful of juvenile hominin fossil skeletons known.&lt;/p&gt;&lt;p&gt;The project is lead by Dr. Zeresenay Alemseged of the University of Chicago. Core DRP team members include: Zeresenay Alemseged, Andrew Barr, Ren\\\\\\\\\\\\\\\\u00e9 Bobe, Denis Geraads, Shannon McPherron, Denn\\\\\\\\\\\\\\\\u00e9 Reed, and Jonathan Wynn.\\\\\\\\\\\\\\\\u00a0&lt;/p&gt;&lt;p&gt;The data in the Dikika Research Project are currently restricted to project members.</p>\\", \\"id\\": \\"029ce7d4-63ac-4a87-ba3d-b29690e0b143\\"}]", "date": "2020-03-30", "feed_image": null, "location": "SRID=4326;POINT (40.61900000000003 11.09)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	35	4
182	f	2020-06-11 12:47:42.709323-07	{"pk": 39, "path": "00010001000B0006", "depth": 4, "numchild": 0, "title": "Ledi-Geraru Research Project", "draft_title": "Ledi-Geraru Research Project", "slug": "lgrp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/lgrp/", "owner": 4, "seo_title": "lgrp", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:53:49.201Z", "last_published_at": "2020-06-11T19:42:30.959Z", "latest_revision_created_at": "2020-06-11T19:42:30.669Z", "live_revision": 181, "intro": "<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Ledi-Geraru Research Project was started in 2002. Research focuses on answering questions regarding the disappearance of\\\\u00a0<i>Australopithecus afarensis</i>\\\\u00a0and the appearance of the genus\\\\u00a0<i>Homo</i>\\\\u00a0in the time period from 2.95 Ma- 2.4 Ma. These questions are related to habitat and behavioral differences between the two species. Fossiliferous sediments of that age are fairly rare in the Lower Awash Valley, but are present in the Ledi-Geraru, as well as some deposits that are younger still.</p><p>Co-leaders of the project are Kaye Reed, Ramon Arrowsmith, Christopher Campisano, and Brian Villmoare. Other participants include Lars Werdelin, Vera Aldeais, Marion Bamford, David Braun, Alan Deino, Erin DiMaggio, Guillaume Dupont-Nivet, David Feary, William Kimbel, Amy Rector, Joshua Robinson, William Archer, Blade Engda, Domnique Garello, Jacob Harris, Ignacio Lazagabaster, Ellis Locke, David Patterson, John Rowan, Chalachew Seyoum, Niguss Tsehay, Eric Scott, and Irene Smail.\\\\u00a0The data in the Ledi-Geraru Research Project are currently restricted to project members.</p>\\", \\"id\\": \\"467c2948-59d5-4b43-9c4d-f0e86bf33c4a\\"}]", "date": "2020-03-30", "feed_image": 37, "location": "SRID=4326;POINT (40.86023799999998 11.351285)", "is_public": false, "app_label": "lgrp", "carousel_items": [], "related_links": [], "tagged_items": []}	\N	39	4
188	f	2020-06-11 14:32:39.543802-07	{"pk": 43, "path": "00010001000B000A", "depth": 4, "numchild": 0, "title": "West Turkana Archaeology Project", "draft_title": "West Turkana Archaeology Project", "slug": "wtap", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/wtap/", "owner": 4, "seo_title": "wtap", "show_in_menus": false, "search_description": "West Turkana Archaeology Project", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "intro": "<p><br/></p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The West Turkana Archaeological Project (WTAP)\\\\u00a0is a multinational interdisciplinary research collaboration that seeks to\\\\u00a0uncover artifactual and\\\\u00a0fossil traces of Plio-Pleistocene hominin behavioral evolution in\\\\u00a0the sedimentary exposures of the Nachukui Formation west of\\\\u00a0Lake Turkana in northern Kenya. The WTAP is now best known for the discovery of the oldest stone tools at Lomekwi 3, dated to 3.3 Ma, and the oldest Acheulean handaxes at Kokiselei 4, dated to 1.76 Ma.</p><p><br/></p><p>The project is directed by Dr.\\\\u00a0Sonia Harmand (Turkana Basin\\\\u00a0Institute [TBI] and\\\\u00a0Dept. of\\\\u00a0Anthropology at Stony Brook University, and the CNRS) and Dr. Jason Lewis (TBI &amp; Anthro at Stony Brook). Core WTAP team members additionally include: Helene Roche, Craig Feibel, Sandrine Prat, Xavier Bo\\\\u00ebs, Nicholas Taylor, Jean-Philip Brugal.</p>\\", \\"id\\": \\"df6c8aff-693c-4e56-814d-7fa3fe6de5c3\\"}]", "date": "2020-06-11", "feed_image": 40, "location": "SRID=4326;POINT (35.8 4)", "is_public": false, "app_label": null, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	43	4
203	f	2020-06-28 09:09:49.407537-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 0, "title": "Paleo Core Standards", "draft_title": "Paleo Core Standards", "slug": "standard", "content_type": 34, "live": false, "has_unpublished_changes": true, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": "2020-06-28T16:09:44.017Z", "live_revision": null, "subtitle": "", "intro": "<p>Paleo Core draws upon standard terms to allow the free exchange of information between research teams. Paleo Core draws from the standards, ontologies and vocabularies listed below.\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Dublin Core</h3><p>A metadata initiative for publications and online resources.</p><p>namespace abbreviation: dcmi<br/>uri:\\\\u00a0<a href=\\\\\\"http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">http://dublincore.org/2012/06/14/dcterms.rdf</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">WebVOWL visualization</a><br/>website:\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">http://dublincore.org</a></p><h3>Darwin Core<br/></h3><p>A metadata initiative for biodiversity.</p><p>namespace abreviation: dwc<br/>uri:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">http://rs.tdwg.org/dwc/terms/</a><br/>website:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/\\\\\\">http://rs.tdwg.org</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extensions.do\\\\\\">Extensions</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa\\\\\\">QA wiki</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa/wiki/Webinars\\\\\\">Webinars</a></p><p></p><h3>Biological Collections Ontology</h3><p></p><p>An biodiversity and collections ontology based on Darwin Core metadata terms.</p><p>namespace abbreviation: bco<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><h3>Friend of a Friend Ontology</h3><p>An ontology for people, organizations and social networks.</p><p>namespace abbreviation: foaf<br/>uri:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a><br/></p><h3>Paleo Core</h3><p>A Metadata initiative for paleoanthropology.</p><p>namespace abbreviation: pc</p><p>The listing and documentation for Paleo Core terms is being revised and coordinated with the efforts of the TDWG Paleo interest group. Feel free to follow or contribute to the group&#39;s progress on\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/paleo\\\\\\">github</a>.</p><h3>Uberon Ontology</h3><p>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.<br/></p><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
238	f	2020-07-08 13:50:12.581841-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 0, "title": "Paleo Core Standards", "draft_title": "Paleo Core Standards", "slug": "standard", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-28T16:09:54.724Z", "last_published_at": "2020-06-28T16:09:54.724Z", "latest_revision_created_at": "2020-06-28T16:09:54.515Z", "live_revision": 204, "subtitle": "", "intro": "<p>Paleo Core draws upon standard terms to allow the free exchange of information between research teams. Paleo Core draws from the standards, ontologies and vocabularies listed below.\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Dublin Core</h3><p>A metadata initiative for publications and online resources.</p><p>namespace abbreviation: dcmi<br/>uri:\\\\u00a0<a href=\\\\\\"http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">http://dublincore.org/2012/06/14/dcterms.rdf</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">WebVOWL visualization</a><br/>website:\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">http://dublincore.org</a></p><h3>Darwin Core<br/></h3><p>A metadata initiative for biodiversity.</p><p>namespace abreviation: dwc<br/>uri:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">http://rs.tdwg.org/dwc/terms/</a><br/>website:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/\\\\\\">http://rs.tdwg.org</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extensions.do\\\\\\">Extensions</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa\\\\\\">QA wiki</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa/wiki/Webinars\\\\\\">Webinars</a></p><p></p><h3>Biological Collections Ontology</h3><p></p><p>An biodiversity and collections ontology based on Darwin Core metadata terms.</p><p>namespace abbreviation: bco<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><h3>Friend of a Friend Ontology</h3><p>An ontology for people, organizations and social networks.</p><p>namespace abbreviation: foaf<br/>uri:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a><br/></p><h3>Paleo Core</h3><p>A Metadata initiative for paleoanthropology.</p><p>namespace abbreviation: pc<br/>uri: https://paleocore.org/pc/terms/<br/>website: https://paleocore.org/standards/pc<br/><br/></p><h3>Uberon Ontology</h3><p>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.<br/></p><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
74	f	2020-03-08 22:15:33.5091-07	{"pk": 32, "path": "00010001000A", "depth": 3, "numchild": 0, "title": "About Paleo Core", "draft_title": "About Paleo Core", "slug": "about-paleo-core", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/about-paleo-core/", "owner": 4, "seo_title": "About PC", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-09T05:10:16.210Z", "last_published_at": "2020-03-09T05:12:46.718Z", "latest_revision_created_at": "2020-03-09T05:12:46.520Z", "live_revision": 73, "subtitle": "", "intro": "", "body": "[{\\"type\\": \\"image\\", \\"value\\": 15, \\"id\\": \\"365945de-8836-42da-9084-c7255650e7b8\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Mission</h2><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.<br/></p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p>\\", \\"id\\": \\"b7f739e5-f335-4b5a-a52e-51cf1f2dfa75\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Goals</h2><p></p><ol><li>to implement and extend data standards for paleoanthropology;<br/></li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;\\\\u00a0<br/></li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.<br/></li></ol><p></p>\\", \\"id\\": \\"84824cf2-a127-4a81-babf-31eee3b947cf\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>The Name</h2><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">Dublin Core</a>,\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">Darwin Core</a>\\\\u00a0and\\\\u00a0<a href=\\\\\\"http://www.tdwg.org/standards/115/download/ABCD_v206.html\\\\\\">Access to Biological Collections Data</a>\\\\u00a0(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p>\\", \\"id\\": \\"0af9c5b3-493c-4719-87c0-caf955ffe2f3\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	32	4
239	f	2020-07-08 13:50:30.557221-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 0, "title": "Paleo Core Standards", "draft_title": "Paleo Core Standards", "slug": "standard", "content_type": 34, "live": true, "has_unpublished_changes": true, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-28T16:09:54.724Z", "last_published_at": "2020-06-28T16:09:54.724Z", "latest_revision_created_at": "2020-07-08T20:50:12.581Z", "live_revision": 204, "subtitle": "", "intro": "<p>Paleo Core draws upon standard terms to allow the free exchange of information between research teams. Paleo Core draws from the standards, ontologies and vocabularies listed below.\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Dublin Core</h3><p>A metadata initiative for publications and online resources.</p><p>namespace abbreviation: dcmi<br/>uri:\\\\u00a0<a href=\\\\\\"http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">http://dublincore.org/2012/06/14/dcterms.rdf</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">WebVOWL visualization</a><br/>website:\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">http://dublincore.org</a></p><h3>Darwin Core<br/></h3><p>A metadata initiative for biodiversity.</p><p>namespace abreviation: dwc<br/>uri:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">http://rs.tdwg.org/dwc/terms/</a><br/>website:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/\\\\\\">http://rs.tdwg.org</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extensions.do\\\\\\">Extensions</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa\\\\\\">QA wiki</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa/wiki/Webinars\\\\\\">Webinars</a></p><p></p><h3>Biological Collections Ontology</h3><p></p><p>An biodiversity and collections ontology based on Darwin Core metadata terms.</p><p>namespace abbreviation: bco<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><h3>Friend of a Friend Ontology</h3><p>An ontology for people, organizations and social networks.</p><p>namespace abbreviation: foaf<br/>uri:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a><br/></p><h3>Paleo Core</h3><p>A Metadata initiative for paleoanthropology.</p><p>namespace abbreviation: pc<br/>uri: https://paleocore.org/pc/terms/<br/>website: https://paleocore.org/standards/pc<br/><br/></p><h3>Uberon Ontology</h3><p>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.<br/></p><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
189	f	2020-06-11 14:36:00.335921-07	{"pk": 43, "path": "00010001000B000A", "depth": 4, "numchild": 0, "title": "West Turkana Archaeology Project", "draft_title": "West Turkana Archaeology Project", "slug": "wtap", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/wtap/", "owner": 4, "seo_title": "wtap", "show_in_menus": false, "search_description": "West Turkana Archaeology Project", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-11T21:32:39.797Z", "last_published_at": "2020-06-11T21:32:39.797Z", "latest_revision_created_at": "2020-06-11T21:32:39.543Z", "live_revision": 188, "intro": "<p>A Plio-Pleistocene site in northern Kenay</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The West Turkana Archaeological Project (WTAP)\\\\u00a0is a multinational interdisciplinary research collaboration that seeks to\\\\u00a0uncover artifactual and\\\\u00a0fossil traces of Plio-Pleistocene hominin behavioral evolution in\\\\u00a0the sedimentary exposures of the Nachukui Formation west of\\\\u00a0Lake Turkana in northern Kenya. The WTAP is now best known for the discovery of the oldest stone tools at Lomekwi 3, dated to 3.3 Ma, and the oldest Acheulean handaxes at Kokiselei 4, dated to 1.76 Ma.</p><p><br/></p><p>The project is directed by Dr.\\\\u00a0Sonia Harmand (Turkana Basin\\\\u00a0Institute [TBI] and\\\\u00a0Dept. of\\\\u00a0Anthropology at Stony Brook University, and the CNRS) and Dr. Jason Lewis (TBI &amp; Anthro at Stony Brook). Core WTAP team members additionally include: Helene Roche, Craig Feibel, Sandrine Prat, Xavier Bo\\\\u00ebs, Nicholas Taylor, Jean-Philip Brugal.</p>\\", \\"id\\": \\"df6c8aff-693c-4e56-814d-7fa3fe6de5c3\\"}]", "date": "2020-06-11", "feed_image": 40, "location": "SRID=4326;POINT (35.8 4)", "is_public": false, "app_label": null, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	43	4
218	f	2020-06-29 11:47:58.564766-07	{"pk": 53, "path": "00010001000F0005", "depth": 4, "numchild": 0, "title": "Example Form", "draft_title": "Example Form", "slug": "example-form", "content_type": 70, "live": true, "has_unpublished_changes": false, "url_path": "/home/example-site/example-form/", "owner": 4, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "to_address": "denne.reed@gmail.com", "from_address": "no-reply@example-site.org", "subject": "test", "intro": "<p>You think water moves fast? You should see ice. It moves like it has a mind. Like it knows it killed the world once and got a taste for murder. After the avalanche, it took us a week to climb out. Now, I don&#39;t know exactly when we turned on each other, but I know that seven of us survived the slide... and only five made it out. Now we took an oath, that I&#39;m breaking now. We said we&#39;d say it was the snow that killed the other two, but it wasn&#39;t. Nature is lethal but it doesn&#39;t hold a candle to man.<br/></p>", "thank_you_text": "", "feed_image": null, "form_fields": [{"pk": 1, "sort_order": 0, "label": "Name", "field_type": "singleline", "required": true, "choices": "", "default_value": "", "help_text": "Your name", "page": 53}, {"pk": 2, "sort_order": 1, "label": "Email", "field_type": "email", "required": true, "choices": "", "default_value": "", "help_text": "Your email address", "page": 53}, {"pk": 3, "sort_order": 2, "label": "Opinion", "field_type": "multiline", "required": false, "choices": "", "default_value": "", "help_text": "Your opinion", "page": 53}, {"pk": 4, "sort_order": 3, "label": "Number", "field_type": "number", "required": true, "choices": "", "default_value": "", "help_text": "Any number", "page": 53}, {"pk": 5, "sort_order": 4, "label": "Homepage", "field_type": "url", "required": true, "choices": "", "default_value": "", "help_text": "Your home page URL", "page": 53}, {"pk": 6, "sort_order": 5, "label": "Ice cream", "field_type": "checkbox", "required": true, "choices": "", "default_value": "", "help_text": "Check this box if you like ice cream.", "page": 53}, {"pk": 7, "sort_order": 6, "label": "Choices", "field_type": "checkboxes", "required": true, "choices": "cars, boats, squirrels, milk shakes", "default_value": "", "help_text": "Check all the boxes that apply", "page": 53}, {"pk": 8, "sort_order": 7, "label": "Inspiration", "field_type": "dropdown", "required": true, "choices": "Angela Davis, Samuel L Jackson, Harriette Tubman, Dangerfield Newby, Fredrick Douglas", "default_value": "", "help_text": "Choose the person who inspires you.", "page": 53}]}	\N	53	4
134	f	2020-04-09 16:58:46.342205-07	{"pk": 34, "path": "00010001000B0001", "depth": 4, "numchild": 0, "title": "Eyasi Plateau Paleontology Project (EPPE)", "draft_title": "Eyasi Plateau Paleontology Project (EPPE)", "slug": "eppe", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/eppe/", "owner": 4, "seo_title": "eppe", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T04:00:35.226Z", "last_published_at": "2020-04-09T23:30:03.867Z", "latest_revision_created_at": "2020-04-09T23:30:03.683Z", "live_revision": 128, "intro": "<p>The EPPE Laeotoli specimen database contains 13713 records of plant and animal fossils (ca. 28248 specimens) collected by EPPE field teams working at Laetoli, Tanzania. This database is a digital version of the original hard-copy specimen catalog and documents the discovery, stratigraphic provenience and taxonomic diversity of Pliocene and Pleistocene fauna and flora in\\u00a0 northern Tanzania in the time range between 3.7 Ma to 200 ka. The collections include important lectotypes for\\u00a0<i>Australopithecus afarensis</i>, the first record of\\u00a0<i>Paranthropus aethiopicus</i>\\u00a0outside Kenya and early records of our own species\\u00a0<i>Homo sapiens</i>. The taxonomic identifications appearing in this dataset are the original field identifications and are provisional. Any taxonomic analysis employing this dataset should refer to updated identifications published by specialists in the appropriate taxonomic domain (e.g. Harrison 2011).\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The EPPE Laeotoli specimen database contains 13713 records of plant and animal fossils (ca. 28248 specimens) collected by EPPE field teams working at Laetoli, Tanzania. This database is a digital version of the original hard-copy specimen catalog and documents the discovery, stratigraphic provenience and taxonomic diversity of Pliocene and Pleistocene fauna and flora in\\\\u00a0 northern Tanzania in the time range between 3.7 Ma to 200 ka. The collections include important lectotypes for\\\\u00a0<i>Australopithecus afarensis</i>, the first record of\\\\u00a0<i>Paranthropus aethiopicus</i>\\\\u00a0outside Kenya and early records of our own species\\\\u00a0<i>Homo sapiens</i>. The taxonomic identifications appearing in this dataset are the original field identifications and are provisional. Any taxonomic analysis employing this dataset should refer to updated identifications published by specialists in the appropriate taxonomic domain (e.g. Harrison 2011).\\\\u00a0</p>\\", \\"id\\": \\"49fe291c-91d2-44ad-b5ca-27f1ae72b726\\"}]", "date": "2020-03-30", "feed_image": 26, "location": "SRID=4326;POINT (35.14999999999998 -3.4)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	34	4
132	f	2020-04-09 16:46:57.001819-07	{"pk": 35, "path": "00010001000B0002", "depth": 4, "numchild": 0, "title": "Dikika Research Project (DRP)", "draft_title": "Dikika Research Project (DRP)", "slug": "drp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/drp/", "owner": 4, "seo_title": "drp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:46:39.803Z", "last_published_at": "2020-04-09T23:28:42.973Z", "latest_revision_created_at": "2020-04-09T23:28:42.734Z", "live_revision": 127, "intro": "<p>A Pliocene Site in Ethiopia</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Dikika Research Project (DRP) studies Pliocene hominins and paleoenvironments in the Afar Region of northeastern Ethiopia. Dikika is best known for the 3.3 Ma juvenile &lt;i&gt;Australopithecus afarensis&lt;/i&gt; fossil known as \\\\\\\\\\\\\\\\\\\\\\\\&quot;Selam\\\\\\\\\\\\\\\\\\\\\\\\&quot;. Selam is the most complete fossil skeleton of this species and one of just a handful of juvenile hominin fossil skeletons known.&lt;/p&gt;&lt;p&gt;The project is lead by Dr. Zeresenay Alemseged of the University of Chicago. Core DRP team members include: Zeresenay Alemseged, Andrew Barr, Ren\\\\\\\\\\\\\\\\u00e9 Bobe, Denis Geraads, Shannon McPherron, Denn\\\\\\\\\\\\\\\\u00e9 Reed, and Jonathan Wynn.\\\\\\\\\\\\\\\\u00a0&lt;/p&gt;&lt;p&gt;The data in the Dikika Research Project are currently restricted to project members.</p>\\", \\"id\\": \\"029ce7d4-63ac-4a87-ba3d-b29690e0b143\\"}]", "date": "2020-03-30", "feed_image": 23, "location": "SRID=4326;POINT (40.61900000000003 11.09)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	35	4
