190	f	2020-06-11 14:36:14.933493-07	{"pk": 43, "path": "00010001000B000A", "depth": 4, "numchild": 0, "title": "West Turkana Archaeology Project", "draft_title": "West Turkana Archaeology Project", "slug": "wtap", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/wtap/", "owner": 4, "seo_title": "wtap", "show_in_menus": false, "search_description": "West Turkana Archaeology Project", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-11T21:32:39.797Z", "last_published_at": "2020-06-11T21:36:00.697Z", "latest_revision_created_at": "2020-06-11T21:36:00.335Z", "live_revision": 189, "intro": "<p>A Plio-Pleistocene site in northern Kenya</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The West Turkana Archaeological Project (WTAP)\\\\u00a0is a multinational interdisciplinary research collaboration that seeks to\\\\u00a0uncover artifactual and\\\\u00a0fossil traces of Plio-Pleistocene hominin behavioral evolution in\\\\u00a0the sedimentary exposures of the Nachukui Formation west of\\\\u00a0Lake Turkana in northern Kenya. The WTAP is now best known for the discovery of the oldest stone tools at Lomekwi 3, dated to 3.3 Ma, and the oldest Acheulean handaxes at Kokiselei 4, dated to 1.76 Ma.</p><p><br/></p><p>The project is directed by Dr.\\\\u00a0Sonia Harmand (Turkana Basin\\\\u00a0Institute [TBI] and\\\\u00a0Dept. of\\\\u00a0Anthropology at Stony Brook University, and the CNRS) and Dr. Jason Lewis (TBI &amp; Anthro at Stony Brook). Core WTAP team members additionally include: Helene Roche, Craig Feibel, Sandrine Prat, Xavier Bo\\\\u00ebs, Nicholas Taylor, Jean-Philip Brugal.</p>\\", \\"id\\": \\"df6c8aff-693c-4e56-814d-7fa3fe6de5c3\\"}]", "date": "2020-06-11", "feed_image": 40, "location": "SRID=4326;POINT (35.8 4)", "is_public": false, "app_label": null, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	43	4
82	f	2020-03-26 12:43:08.660594-07	{"pk": 32, "path": "00010001000A", "depth": 3, "numchild": 0, "title": "About Paleo Core", "draft_title": "About Paleo Core", "slug": "about", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/about-paleo-core/", "owner": 4, "seo_title": "About", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-09T05:10:16.210Z", "last_published_at": "2020-03-09T05:15:33.704Z", "latest_revision_created_at": "2020-03-09T05:15:33.509Z", "live_revision": 74, "subtitle": "", "intro": "", "body": "[{\\"type\\": \\"image\\", \\"value\\": 15, \\"id\\": \\"365945de-8836-42da-9084-c7255650e7b8\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Mission</h2><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.<br/></p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p>\\", \\"id\\": \\"b7f739e5-f335-4b5a-a52e-51cf1f2dfa75\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Goals</h2><p></p><ol><li>to implement and extend data standards for paleoanthropology;<br/></li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;\\\\u00a0<br/></li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.<br/></li></ol><p></p>\\", \\"id\\": \\"84824cf2-a127-4a81-babf-31eee3b947cf\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>The Name</h2><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">Dublin Core</a>,\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">Darwin Core</a>\\\\u00a0and\\\\u00a0<a href=\\\\\\"http://www.tdwg.org/standards/115/download/ABCD_v206.html\\\\\\">Access to Biological Collections Data</a>\\\\u00a0(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p>\\", \\"id\\": \\"0af9c5b3-493c-4719-87c0-caf955ffe2f3\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	32	4
87	f	2020-03-26 13:45:27.84821-07	{"pk": 32, "path": "00010001000A", "depth": 3, "numchild": 0, "title": "About Paleo Core", "draft_title": "About", "slug": "about", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/about/", "owner": 4, "seo_title": "About", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-09T05:10:16.210Z", "last_published_at": "2020-03-26T20:43:22.387Z", "latest_revision_created_at": "2020-03-26T20:43:22.195Z", "live_revision": 86, "subtitle": "", "intro": "<h2>Mission</h2><p>PaleoCore serves the scientific community by addressing the common challenge of integrating data across independent research projects. Answers to major scientific questions arise when independent groups can successfully search, exchange and integrate their data.</p><p>PaleoCore serves the student and academic community by organizing disparate sources of information in a way that students and teachers can use to explore human origins.</p><p>PaleoCore serves the broader public by providing timely, current knowledge on human origins research. PaleoCore works closely with eFossils, eSkeletons and eLucy to provide intuitive explanations of complex topics in human origins.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p><embed alt=\\\\\\"logo3_400.png\\\\\\" embedtype=\\\\\\"image\\\\\\" format=\\\\\\"fullwidth\\\\\\" id=\\\\\\"17\\\\\\"/></p>\\", \\"id\\": \\"2b34b56d-3924-4d07-afb3-bee84324e43e\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Goals</h2><p></p><ol><li>to implement and extend data standards for paleoanthropology;<br/></li><li>to maintain an online spatial data repository of artefactual, fossil and geological occurrences;\\\\u00a0<br/></li><li>to develop digital data collection workflows that promote rapid and real-time data collection in the field using mobile devices.<br/></li></ol><p></p>\\", \\"id\\": \\"84824cf2-a127-4a81-babf-31eee3b947cf\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>The Name</h2><p>The name &quot;Paleo Core&quot; is a reference to existing international data standards such as\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">Dublin Core</a>,\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">Darwin Core</a>\\\\u00a0and\\\\u00a0<a href=\\\\\\"http://www.tdwg.org/standards/115/download/ABCD_v206.html\\\\\\">Access to Biological Collections Data</a>\\\\u00a0(ABCD). A core aim of the PaleoCore project is to provide stable implementation of these standards with specific examples of best practices in the domain of paleoanthropology, including suggestions for modifications and extensions to existing standards that make them more applicable for paleoanthropological and prehistory applications.</p>\\", \\"id\\": \\"0af9c5b3-493c-4719-87c0-caf955ffe2f3\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	32	4
220	f	2020-06-29 11:50:50.641463-07	{"pk": 55, "path": "00010001000F0007", "depth": 4, "numchild": 0, "title": "Example Person Index", "draft_title": "Example Person Index", "slug": "example-person-index", "content_type": 76, "live": true, "has_unpublished_changes": false, "url_path": "/home/example-site/example-person-index/", "owner": 4, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "subtitle": "Example Subtitle", "intro": "<p>Example intro. Now that we know who you are, I know who I am. I&#39;m not a mistake! It all makes sense! In a comic, you know how you can tell who the arch-villain&#39;s going to be? He&#39;s the exact opposite of the hero. And most times they&#39;re friends, like you and me! I should&#39;ve known way back when... You know why, David? Because of the kids. They called me Mr Glass.</p>", "feed_image": null, "related_links": []}	\N	55	4
241	f	2020-07-08 13:53:08.21191-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 1, "title": "Meta Data Standards", "draft_title": "Paleo Core Standards", "slug": "standard", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-28T16:09:54.724Z", "last_published_at": "2020-07-08T20:52:22.042Z", "latest_revision_created_at": "2020-07-08T20:52:21.802Z", "live_revision": 240, "subtitle": "", "intro": "<p>Paleo Core draws upon standard terms to allow the free exchange of information between research teams. Paleo Core draws from the standards, ontologies and vocabularies listed below.\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Dublin Core</h3><p>A metadata initiative for publications and online resources.</p><p>namespace abbreviation: dcmi<br/>uri:\\\\u00a0<a href=\\\\\\"http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">http://dublincore.org/2012/06/14/dcterms.rdf</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">WebVOWL visualization</a><br/>website:\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">http://dublincore.org</a></p><h3>Darwin Core<br/></h3><p>A metadata initiative for biodiversity.</p><p>namespace abreviation: dwc<br/>uri:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">http://rs.tdwg.org/dwc/terms/</a><br/>website:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/\\\\\\">http://rs.tdwg.org</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extensions.do\\\\\\">Extensions</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa\\\\\\">QA wiki</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa/wiki/Webinars\\\\\\">Webinars</a></p><p></p><h3>Biological Collections Ontology</h3><p></p><p>An biodiversity and collections ontology based on Darwin Core metadata terms.</p><p>namespace abbreviation: bco<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><h3>Friend of a Friend Ontology</h3><p>An ontology for people, organizations and social networks.</p><p>namespace abbreviation: foaf<br/>uri:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a><br/></p><h3>Paleo Core</h3><p>A Metadata initiative for paleoanthropology.</p><p>namespace abbreviation: pc<br/>uri: https://paleocore.org/pc/terms/<br/>website: https://paleocore.org/standards/pc<br/><br/></p><h3>Uberon Ontology</h3><p>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.<br/></p><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
