201	f	2020-06-28 09:09:41.035099-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 0, "title": "Paleo Core Standards", "draft_title": "Paleo Core Standards", "slug": "standard", "content_type": 34, "live": false, "has_unpublished_changes": false, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "subtitle": "", "intro": "<p>Paleo Core draws upon standard terms to allow the free exchange of information between research teams. Paleo Core draws from the standards, ontologies and vocabularies listed below.\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Dublin Core</h3><p>A metadata initiative for publications and online resources.</p><p>namespace abbreviation: dcmi<br/>uri:\\\\u00a0<a href=\\\\\\"http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">http://dublincore.org/2012/06/14/dcterms.rdf</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">WebVOWL visualization</a><br/>website:\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">http://dublincore.org</a></p><h3>Darwin Core<br/></h3><p>A metadata initiative for biodiversity.</p><p>namespace abreviation: dwc<br/>uri:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">http://rs.tdwg.org/dwc/terms/</a><br/>website:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/\\\\\\">http://rs.tdwg.org</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extensions.do\\\\\\">Extensions</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa\\\\\\">QA wiki</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa/wiki/Webinars\\\\\\">Webinars</a></p><p></p><h3>Biological Collections Ontology</h3><p></p><p>An biodiversity and collections ontology based on Darwin Core metadata terms.</p><p>namespace abbreviation: bco<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><h3>Friend of a Friend Ontology</h3><p>An ontology for people, organizations and social networks.</p><p>namespace abbreviation: foaf<br/>uri:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a><br/></p><h3>Paleo Core</h3><p>A Metadata initiative for paleoanthropology.</p><p>namespace abbreviation: pc</p><p>The listing and documentation for Paleo Core terms is being revised and coordinated with the efforts of the TDWG Paleo interest group. Feel free to follow or contribute to the group&#39;s progress on\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/paleo\\\\\\">github</a>.</p><h3>Uberon Ontology</h3><p>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.<br/></p><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
107	f	2020-03-30 22:54:10.911674-07	{"pk": 38, "path": "00010001000B0005", "depth": 4, "numchild": 0, "title": "Mille-Logya Resarch Project", "draft_title": "Mille-Logya Resarch Project", "slug": "mlp", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/mille-logya-resarch-project/", "owner": 4, "seo_title": "mlp", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T05:52:04.614Z", "last_published_at": "2020-03-31T05:52:04.614Z", "latest_revision_created_at": "2020-03-31T05:52:04.359Z", "live_revision": 105, "intro": "<p>A Plio-Pleistocene site in the Afar region of northeaster Ethiopia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Mille-Logya Research Project (MLP) is a paleoanthropological research effort located in northeastern Ethiopia, just a few kilometers north of Hadar and Dikika. The project was initiated in 2014.\\\\\\\\\\\\\\\\u00a0The project is lead by Dr. Zeresenay Alemseged of the University of Chicago.\\\\\\\\\\\\\\\\u00a0&lt;/p&gt;&lt;p&gt;The data in the Mille-Logya Project are currently restricted to project members.<br/></p>\\", \\"id\\": \\"d68ec6af-538b-4cdf-84f2-4406081d722b\\"}]", "date": "2020-03-30", "feed_image": null, "location": "SRID=4326;POINT (11.583 40.80999999999995)", "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	38	4
