100	f	2020-03-30 21:02:54.209141-07	{"pk": 34, "path": "00010001000B0001", "depth": 4, "numchild": 0, "title": "Eyasi Plateau Paleontology Project (EPPE)", "draft_title": "Eyasi Plateau Paleontology Project (EPPE)", "slug": "eppe", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/eyasi-plateau-paleontology-project-eppe/", "owner": 4, "seo_title": "eppe", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-03-31T04:00:35.226Z", "last_published_at": "2020-03-31T04:00:35.226Z", "latest_revision_created_at": "2020-03-31T04:00:34.973Z", "live_revision": 99, "intro": "<p>The EPPE Laeotoli specimen database contains 13713 records of plant and animal fossils (ca. 28248 specimens) collected by EPPE field teams working at Laetoli, Tanzania. This database is a digital version of the original hard-copy specimen catalog and documents the discovery, stratigraphic provenience and taxonomic diversity of Pliocene and Pleistocene fauna and flora in\\u00a0 northern Tanzania in the time range between 3.7 Ma to 200 ka. The collections include important lectotypes for\\u00a0<i>Australopithecus afarensis</i>, the first record of\\u00a0<i>Paranthropus aethiopicus</i>\\u00a0outside Kenya and early records of our own species\\u00a0<i>Homo sapiens</i>. The taxonomic identifications appearing in this dataset are the original field identifications and are provisional. Any taxonomic analysis employing this dataset should refer to updated identifications published by specialists in the appropriate taxonomic domain (e.g. Harrison 2011).\\u00a0</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The EPPE Laeotoli specimen database contains 13713 records of plant and animal fossils (ca. 28248 specimens) collected by EPPE field teams working at Laetoli, Tanzania. This database is a digital version of the original hard-copy specimen catalog and documents the discovery, stratigraphic provenience and taxonomic diversity of Pliocene and Pleistocene fauna and flora in\\\\u00a0 northern Tanzania in the time range between 3.7 Ma to 200 ka. The collections include important lectotypes for\\\\u00a0<i>Australopithecus afarensis</i>, the first record of\\\\u00a0<i>Paranthropus aethiopicus</i>\\\\u00a0outside Kenya and early records of our own species\\\\u00a0<i>Homo sapiens</i>. The taxonomic identifications appearing in this dataset are the original field identifications and are provisional. Any taxonomic analysis employing this dataset should refer to updated identifications published by specialists in the appropriate taxonomic domain (e.g. Harrison 2011).\\\\u00a0</p>\\", \\"id\\": \\"49fe291c-91d2-44ad-b5ca-27f1ae72b726\\"}]", "date": "2020-03-30", "feed_image": 21, "location": null, "is_public": false, "carousel_items": [], "related_links": [], "tagged_items": []}	\N	34	4
