244	f	2020-07-10 15:44:55.864847-07	{"pk": 62, "path": "00010001000B000B", "depth": 4, "numchild": 0, "title": "Paleo Silk Road", "draft_title": "Paleo Silk Road", "slug": "psr", "content_type": 104, "live": true, "has_unpublished_changes": false, "url_path": "/home/projects/psr/", "owner": 4, "seo_title": "Paleo Silk Road", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "intro": "<p>A survey of Pleistocene sites in Asia.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"In antiquity and the early Middle Ages, a network of trade routes known as the Silk Road connected east Asia and the Middle East. The Silk Road was not just an economic link, but also the avenue for cultural and even genetic exchanges between these regions. Recent genetic discoveries have hinted that such connections might have begun much earlier, during the Pleistocene. The Pleistocene period is of fundamental importance for human history. It is then that our ancestors evolved and colonised the entire Old World, surviving a suite of major extinction events \\\\u2013 and they did so against a dramatic backdrop of ice ages and warmer interglacial phases which substantially altered their habitats. Conquering the extreme environments of arid central Asia to eventually settle the entire Asian mainland and beyond is one of the most impressive feats in this story. Unfortunately, there are too few known Pleistocene archaeological sites in central Asia to allow us to piece together when and how this happened.<br/><br/>PALAEOSILKROAD will resolve this deficit by surveying central Asian mountain foothills as both corridors for human and animal movements and archives of past climate change. The project will discover new sites in the Tian Shan, Dzungar, and southern Altai foothills (Kazakhstan) and use them to examine if and how 1) humans were able to survive in the foothills throughout the last glacial cycle (ca.\\\\u00a0<a href=\\\\\\"tel://110-11 500\\\\\\">110-11 500</a>\\\\u00a0years ago), and 2) periodic advances of mountain glaciers motivated dispersals, population segmentation, and behavioural adaptations. To address these questions, PALAEOSILKROAD will take an ambitious approach rooted in archaeology and contextualised by palaeoenvironmental reconstruction. The results of this project will change the way we understand human dispersals on a global scale and the resilience of early humans in the face of environmental challenges, providing a major missing link to explain how Homo sapiens became the only surviving species of our genus.<br/><br/>The Principal Investigator is Prof. Radu Iovita (New York University, University of T\\\\u00fcbingen)<br/><p><a href=\\\\\\"https://www.palaeosilkroad.eu/\\\\\\">https://www.palaeosilkroad.eu/</a></p>\\", \\"id\\": \\"18b37bc4-a499-4186-ab50-6ea3a51d1f2a\\"}]", "date": "2020-07-10", "feed_image": 44, "location": "SRID=4326;POINT (76.91495399999999 43.252757)", "is_public": false, "app_label": "psr", "carousel_items": [], "related_links": [], "tagged_items": [{"pk": 29, "tag": 40, "content_object": 62}, {"pk": 30, "tag": 41, "content_object": 62}]}	\N	62	4
245	f	2020-07-12 14:45:14.576009-07	{"pk": 46, "path": "00010001000E", "depth": 3, "numchild": 1, "title": "Paleo Core", "draft_title": "Meta Data Standards", "slug": "standard", "content_type": 34, "live": true, "has_unpublished_changes": false, "url_path": "/home/standard/", "owner": 4, "seo_title": "Standard", "show_in_menus": true, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2020-06-28T16:09:54.724Z", "last_published_at": "2020-07-08T20:53:08.499Z", "latest_revision_created_at": "2020-07-08T20:53:08.211Z", "live_revision": 241, "subtitle": "A data standard for paleoanthropology.", "intro": "<p>The Paleo Core standard is an implementation and extension of the Darwin Core standard for describing biodiversity data.</p>", "body": "[{\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>The Paleo Core data standard is an implementation of Darwin Core for paleoanthropology that draws from the Darwin Core standard terms and from the Chronological Age extension. Additionally, Paleo Core introduces new classes for archaeological and geological occurrences along with new attributes appropriate to these classes. These changes also precipitate minor reassignments of attributes between occurrence classes.</p>\\", \\"id\\": \\"dcae2f46-510f-41f2-9635-ef7e844651b9\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<p>This page provides an index to all the terms used by Paleo Core with links to their sources, commentary and examples for implementation of the terms for paleoanthropology and definitions for newly minted Paleo Core terms.</p><p>Given the broad range of information collected and utilized in paleoanthropology the metadata schemes are large and can be cumbersome. Paleo Core identifies a minimum subset of terms that reflect the most significant and consistently employed concepts in paleoanthropology based on an analysis of several active projects hosted at paleocore.org and in published data dictionaries.</p>\\", \\"id\\": \\"02927821-c9ca-41cd-8034-a9e61aa856c9\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Paleo Core</h2><h3>A metadata initiative for paleoanthropology</h3><h3>namespace abbreviation: pc<br/>uri: https://paleocore.org/standard/terms/<br/>website: https://paleocore.org/standards/pc</h3><p><hr/></p>\\", \\"id\\": \\"6bb17a83-a492-4ddb-a236-0797748a8554\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Dublin Core</h3><h3>A metadata initiative for publications and online resources.</h3><p>namespace abbreviation: dcmi<br/>uri:\\\\u00a0<a href=\\\\\\"http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">http://dublincore.org/2012/06/14/dcterms.rdf</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://dublincore.org/2012/06/14/dcterms.rdf\\\\\\">WebVOWL visualization</a><br/>website:\\\\u00a0<a href=\\\\\\"http://dublincore.org/\\\\\\">http://dublincore.org</a></p><p><hr/></p>\\", \\"id\\": \\"3f43f7e6-5f01-4b92-9cdb-bfbe0f7d0eda\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Darwin Core<br/></h3><h3>A metadata initiative for biodiversity.</h3><p>namespace abreviation: dwc<br/>uri:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/dwc/terms/\\\\\\">http://rs.tdwg.org/dwc/terms/</a><br/>website:\\\\u00a0<a href=\\\\\\"http://rs.tdwg.org/\\\\\\">http://rs.tdwg.org</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://tools.gbif.org/dwca-validator/extensions.do\\\\\\">Extensions</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa\\\\\\">QA wiki</a><br/>Darwin Core\\\\u00a0<a href=\\\\\\"https://github.com/tdwg/dwc-qa/wiki/Webinars\\\\\\">Webinars</a></p><hr/>\\", \\"id\\": \\"6a395f0b-fc1f-4f9e-bcde-9f2795f0aa59\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h3>Biological Collections Ontology</h3><p></p><h3>A biodiversity and collections ontology based on Darwin Core metadata terms.</h3><p>namespace abbreviation: bco<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/bco.owl\\\\\\">http://purl.obolibrary.org/obo/bco.owl</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://purl.obolibrary.org/obo/bco.owl\\\\\\">WebVOWL visualization</a></p><p><hr/></p>\\", \\"id\\": \\"a422d6db-8c6d-4859-b576-43d82a8d364d\\"}, {\\"type\\": \\"paragraph\\", \\"value\\": \\"<h2>Friend of a Friend Ontology</h2><h3>An ontology for people, organizations and social networks.</h3><p>namespace abbreviation: foaf<br/>uri:\\\\u00a0<a href=\\\\\\"http://xmlns.com/foaf/0.1/\\\\\\">http://xmlns.com/foaf/0.1/</a><br/><a href=\\\\\\"http://visualdataweb.de/webvowl/#iri=http://xmlns.com/foaf/0.1/\\\\\\">WebVOWL visualization</a></p><hr/><h2>Uberon Ontology</h2><h3>An anatomical ontology that represents body parts, organs and tissues in a variety of animal species, with a focus on vertebrates.</h3><p>namespace abbreviation: uberon<br/>uri:\\\\u00a0<a href=\\\\\\"http://purl.obolibrary.org/obo/uberon.owl\\\\\\">http://purl.obolibrary.org/obo/uberon.owl</a><br/>webpage:\\\\u00a0<a href=\\\\\\"http://uberon.github.io/\\\\\\">http://uberon.github.io/</a></p>\\", \\"id\\": \\"e3f22ba1-3244-47e6-851f-364a4bcb4c34\\"}]", "template_string": "pages/standard_page_full.html", "feed_image": null, "carousel_items": [], "related_links": []}	\N	46	4
